    'Olive oil and its fractions, whether or not refined, but not chemically modified' => 'Oljčno olje in njegove frakcije, rafinirano ali ne, toda kemično nemodificirano',
    'Other oils and their fractions, obtained solely from olives, whether or not refined, but not chemically modified, including blends of these oils or fractions with oils or fractions of heading 1509' => 'Druga olja, dobljena izključno iz oljk in njihove frakcije, rafinirana ali ne, toda kemično nemodificirana, vključno mešanice teh olj ali frakcij z olji ali frakcijami iz tarifne številke 1509',
    'Palm oil and its fractions, whether or not refined, but not chemically modified' => 'Palmovo olje in njegove frakcije, rafinirano ali ne, toda kemično nemodificirano',
    'Sunflower-seed, safflower or cotton-seed oil and fractions thereof, whether or not refined, but not chemically modified' => 'Olje iz sončničnih semen, semen žafranike in bombaževega semena in njegove frakcije, rafinirano ali ne, toda kemično nemodificirano',
    'Coconut (copra), palm kernel or babassu oil and fractions thereof, whether or not refined, but not chemically modified' => 'Olje iz kokosovega oreha (kopra), palmovih jedrc (koščic) ali orehov palme babassu in njegove frakcije, rafinirano ali ne, toda kemično nemodificirano',
    'Rape, colza or mustard oil and fractions thereof, whether or not refined, but not chemically modified' => 'Olje iz oljne repice, ogrščice ali gorčice in njegove frakcije, rafinirano ali ne, toda kemično nemodificirano',
    'Other fixed vegetable or microbial fats and oils (including jojoba oil) and their fractions, whether or not refined, but not chemically modified' => 'Druge rastlinske ali mikrobne masti in olja, nehlapna (vključno z jojoba oljem) in njihove frakcije, rafinirani ali ne, toda kemično nemodificirani',
    'Animal, vegetable or microbial fats and oils and their fractions, partly or wholly hydrogenated, inter-esterified, re-esterified or elaidinised, whether or not refined, but not further prepared' => 'Masti in olja živalskega, rastlinskega ali mikrobnega izvora in njihove frakcije, deloma ali v celoti hidrogenirani, interesterificirani, reesterificirani ali elaidinizirani, rafinirani ali ne, toda nadalje nepredelani',
    'Margarine; edible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, other than edible fats or oils or their fractions of heading 1516' => 'Margarina; užitne mešanice ali preparati iz masti ali olj živalskega, rastlinskega ali mikrobnega izvora ali frakcij različnih masti ali olj iz tega poglavja, razen užitnih masti in olj ali njihovih frakcij iz tarifne številke 1516',
    'Animal, vegetable or microbial fats and oils and their fractions, boiled, oxidised, dehydrated, sulphurised, blown, polymerised by heat in vacuum or in inert gas or otherwise chemically modified, excluding those of heading 1516; inedible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, not elsewhere specified or included' => 'Živalske, rastlinske ali mikrobne masti in olja in njihove frakcije, kuhani, oksidirani, dehidrirani, žveplani, prepihani, polimerizirani s segrevanjem v vakuumu ali v inertnem plinu ali drugače kemično modificirani, razen tistih iz tarifne številke 1516; neužitne mešanice ali preparati iz živalskih, rastlinskih ali mikrobnih masti ali olj ali iz frakcij različnih masti ali olj iz tega poglavja, ki niso navedeni in ne zajeti na drugem mestu',
    'Vegetable waxes (other than triglycerides), beeswax, other insect waxes and spermaceti, whether or not refined or coloured' => 'Rastlinski voski (razen trigliceridov), čebelji vosek, voski drugih insektov in spermacet, rafinirani ali ne, barvani ali nebarvani',
    'Degras; residues resulting from the treatment of fatty substances or animal or vegetable waxes' => 'Degras; ostanki, dobljeni pri predelavi maščobnih substanc ali živalskih ali rastlinskih voskov',
    'Sausages and similar products, of meat, meat offal, blood or insects; food preparations based on these products' => 'Klobase in podobni proizvodi iz mesa, klavničnih proizvodov, krvi ali insektov; prehrambni proizvodi na osnovi teh proizvodov',
    'Other prepared or preserved meat, meat offal, blood or insects' => 'Drugi pripravljeni ali konzervirani proizvodi iz mesa, klavničnih proizvodov, krvi ali insektov',
    'Extracts and juices of meat, fish or crustaceans, molluscs or other aquatic invertebrates' => 'Ekstrakti in sokovi iz mesa, rib ali rakov, mehkužcev ali drugih vodnih nevretenčarjev',
    'Prepared or preserved fish; caviar and caviar substitutes prepared from fish eggs' => 'Pripravljene in konzervirane ribe, kaviar in kaviarjevi nadomestki, pripravljeni iz ribjih iker',
    'Crustaceans, molluscs and other aquatic invertebrates, prepared or preserved' => 'Raki, mehkužci in drugi vodni nevretenčarji, pripravljeni ali konzervirani',
    'Cane or beet sugar and chemically pure sucrose, in solid form' => 'Sladkor iz sladkornega trsa ali sladkorne pese ter kemično čista saharoza, v trdnem stanju',
    'Other sugars, including chemically pure lactose, maltose, glucose and fructose, in solid form; sugar syrups not containing added flavouring or colouring matter; artificial honey, whether or not mixed with natural honey; caramel' => 'Drugi sladkorji, vključno s kemično čisto laktozo, maltozo, glukozo in fruktozo, v trdnem stanju; sladkorni sirupi, ki ne vsebujejo dodanih snovi za aromatiziranje ali barvil; umetni med, mešan ali ne z naravnim medom; karamel',
