    'Cocoa paste, whether or not defatted' => 'Kakavova masa, razmaščena ali nerazmaščena',
    'Chocolate and other food preparations containing cocoa' => 'Čokolada in drugi prehrambni proizvodi, ki vsebujejo kakav',
