    'Pasta, whether or not cooked or stuffed (with meat or other substances) or otherwise prepared, such as spaghetti, macaroni, noodles, lasagne, gnocchi, ravioli, cannelloni; couscous, whether or not prepared' => 'Testenine, kuhane ali nekuhane ali polnjene (z mesom ali drugimi snovmi) ali drugače pripravljene, kot so: špageti, makaroni, rezanci, lazanje, njoki, ravioli, kaneloni; kuskus, pripravljen ali nepripravljen',
