    'Bread, pastry, cakes, biscuits and other bakers\' wares, whether or not containing cocoa; communion wafers, empty cachets of a kind suitable for pharmaceutical use, sealing wafers, rice paper and similar products' => 'Kruh, pecivo, torte, keksi in drugi pekovski proizvodi, ki vsebujejo kakav ali ne; hostije, prazne kapsule, primerne za farmacevtsko uporabo, oblati za pečatenje, rižev papir in podobni izdelki',
    'Vegetables, fruit, nuts and other edible parts of plants, prepared or preserved by vinegar or acetic acid' => 'Vrtnine, sadje, oreški in drugi užitni deli rastlin, pripravljeni ali konzervirani v kisu ali ocetni kislini',
    'Tomatoes prepared or preserved otherwise than by vinegar or acetic acid' => 'Paradižnik, pripravljen ali konzerviran drugače kot v kisu ali ocetni kislini',
