    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, frozen, other than products of heading 2006' => 'Druge vrtnine, pripravljene ali konzervirane drugače kot v kisu ali ocetni kislini, zamrznjene, razen proizvodov iz tarifne številke 2006',
    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, not frozen, other than products of heading 2006' => 'Druge vrtnine, pripravljene ali konzervirane drugače kot v kisu ali ocetni kislini, nezamrznjene, razen proizvodov iz tarifne številke 2006',
    'Vegetables, fruit, nuts, fruit-peel and other parts of plants, preserved by sugar (drained, glacé or crystallised)' => 'Vrtnine, sadje, oreški, sadne lupine in drugi deli rastlin, konzervirani v sladkorju (odcejeni, glazirani ali kristalizirani)',
