    'Yeasts (active or inactive); other single-cell micro-organisms, dead (but not including vaccines of heading 3002); prepared baking powders' => 'Kvas (aktiven ali neaktiven); drugi enocelični mikroorganizmi, mrtvi (razen cepiv iz tarifne številke 3002); pripravljeni pecilni praški',
    'Sauces and preparations therefor; mixed condiments and mixed seasonings; mustard flour and meal and prepared mustard' => 'Pripravki za omake in pripravljene omake; mešanice začimb in dišavne mešanice; gorčična moka in zdrob in pripravljena gorčica',
