    'Ice cream and other edible ice, whether or not containing cocoa' => 'Sladoled in druge ledene sladice, ki vsebujejo kakav ali ne',
    'Food preparations not elsewhere specified or included' => 'Živila, ki niso navedena ali zajeta na drugem mestu',
    'Waters, including natural or artificial mineral waters and aerated waters, not containing added sugar or other sweetening matter nor flavoured; ice and snow' => 'Vode, vključno naravne ali umetne mineralne vode in sodavice, ki ne vsebujejo dodanega sladkorja ali drugih sladil ali arom; led in sneg',
