    'Undenatured ethyl alcohol of an alcoholic strength by volume of 80 % vol or higher; ethyl alcohol and other spirits, denatured, of any strength' => 'Nedenaturiran etilni alkohol, z vsebnostjo alkohola 80 vol. % ali več; denaturirani etilni alkohol in drugi destilati, s katero koli vsebnostjo alkohola',
    'Undenatured ethyl alcohol of an alcoholic strength by volume of less than 80 % vol; spirits, liqueurs and other spirituous beverages' => 'Nedenaturiran etilni alkohol, z vsebnostjo alkohola manj kot 80 vol. %; žganja, likerji in druge alkoholne pijače',
    'Vinegar and substitutes for vinegar obtained from acetic acid' => 'Kis in nadomestki kisa, dobljeni iz ocetne kisline',
    'Flours, meals and pellets, of meat or meat offal, of fish or of crustaceans, molluscs or other aquatic invertebrates, unfit for human consumption; greaves' => 'Moka, zdrob in peleti iz mesa ali klavničnih proizvodov, rib ali rakov, mehkužcev ali drugih vodnih nevretenčarjev, neprimerni za prehrano ljudi; ocvirki',
    'Bran, sharps and other residues, whether or not in the form of pellets, derived from the sifting, milling or other working of cereals or of leguminous plants' => 'Otrobi in drugi ostanki pri presejevanju, mletju ali drugi obdelavi žit ali stročnic, v obliki peletov ali ne',
    'Residues of starch manufacture and similar residues, beet-pulp, bagasse and other waste of sugar manufacture, brewing or distilling dregs and waste, whether or not in the form of pellets' => 'Ostanki pri proizvodnji škroba in podobni ostanki, rezanci sladkorne pese, odpadki sladkornega trsa in drugi odpadki pri proizvodnji sladkorja, ostanki in odpadki iz pivovarn ali destilarn, v obliki peletov ali ne',
    'Oilcake and other solid residues, whether or not ground or in the form of pellets, resulting from the extraction of vegetable or microbial fats or oils, other than those of heading 2304 or 2305' => 'Oljne pogače in drugi trdni ostanki, dobljeni pri ekstrakciji rastlinskih ali mikrobnih maščob ali olj, razen tistih iz tarifne številke 2304 ali 2305, nezmleti ali zmleti ali v obliki peletov',
    'Wine lees; argol' => 'Vinske droži; vinski kamen',
    'Vegetable materials and vegetable waste, vegetable residues and by-products, whether or not in the form of pellets, of a kind used in animal feeding, not elsewhere specified or included' => 'Rastlinski materiali in rastlinski odpadki, rastlinski ostanki in stranski proizvodi, v obliki peletov ali ne, ki se uporabljajo kot krma za živali, ki niso navedeni ali zajeti na drugem mestu',
    'Preparations of a kind used in animal feeding' => 'Pripravki, ki se uporabljajo kot krma za živali',
    'Unmanufactured tobacco; tobacco refuse' => 'Nepredelan tobak; tobačni odpadki',
    'Cigars, cheroots, cigarillos and cigarettes, of tobacco or of tobacco substitutes' => 'Cigare, cigare, ki so odprte na obeh koncih, cigarilosi in cigarete iz tobaka ali tobačnih nadomestkov',
    'Other manufactured tobacco and manufactured tobacco substitutes; homogenised or reconstituted tobacco; tobacco extracts and essences' => 'Drug predelan tobak in izdelani tobačni nadomestki; homogeniziran ali rekonstituiran tobak; tobakovi ekstrakti in esence',
    'Products containing tobacco, reconstituted tobacco, nicotine, or tobacco or nicotine substitutes, intended for inhalation without combustion; other nicotine containing products intended for the intake of nicotine into the human body' => 'Izdelki, ki vsebujejo tobak, rekonstituirani tobak, nikotin ali tobačne ali nikotinske nadomestke, namenjeni za vdihavanje brez zgorevanja; drugi izdelki, ki vsebujejo nikotin, namenjeni vnosu nikotina v človeško telo',
    'Salt (including table salt and denatured salt) and pure sodium chloride, whether or not in aqueous solution or containing added anti-caking or free-flowing agents; sea water' => 'Sol (vključno jedilna sol in denaturirana sol) in čisti natrijev klorid, v vodni raztopini ali ne, ali z dodatkom snovi proti skepljanju ali za sipkost ali ne; morska voda',
