    'Kaolin and other kaolinic clays, whether or not calcined' => 'Kaolin in druge kaolinske gline, žgane ali nežgane',
    'Other clays (not including expanded clays of heading 6806), andalusite, kyanite and sillimanite, whether or not calcined; mullite; chamotte or dinas earths' => 'Druge gline (razen ekspandiranih glin iz tarifne številke 6806), andaluzit, kianit in silimanit, žgani ali nežgani; mulit; šamotne in dinas zemljine',
    'Natural calcium phosphates, natural aluminium calcium phosphates and phosphatic chalk' => 'Naravni kalcijevi fosfati, naravni aluminijevi kalcijevi fosfati in fosfatirana kreda',
    'Natural barium sulphate (barytes); natural barium carbonate (witherite), whether or not calcined, other than barium oxide of heading 2816' => 'Naravni barijev sulfat (bariti); naravni barijev karbonat (viterit), žgan ali nežgan, razen barijevega oksida iz tarifne številke 2816',
    'Pumice stone; emery; natural corundum, natural garnet and other natural abrasives, whether or not heat-treated' => 'Plovec; smirek; naravni korund, naravni granat in druge naravne snovi za brušenje, termično obdelane ali neobdelane',
    'Marble, travertine, ecaussine and other calcareous monumental or building stone of an apparent specific gravity of 2,5 or more, and alabaster, whether or not roughly trimmed or merely cut, by sawing or otherwise, into blocks or slabs of a rectangular (including square) shape' => 'Marmor, travertin, ekozin in drug apnenčev kamen za spomenike ali gradbeništvo, navidezne relativne gostote 2,5 ali večje, in alabaster, tudi grobo klesani, razžagani ali kako drugače razrezani v pravokotne (vključno kvadratne) bloke ali plošče',
    'Granite, porphyry, basalt, sandstone and other monumental or building stone, whether or not roughly trimmed or merely cut, by sawing or otherwise, into blocks or slabs of a rectangular (including square) shape' => 'Granit, porfir, bazalt, peščenec in drug kamen za spomenike ali gradbeništvo, tudi grobo klesani ali razžagani ali kako drugače razrezani v kvadratne ali pravokotne bloke ali plošče',
