    'Dolomite, whether or not calcined or sintered, including dolomite roughly trimmed or merely cut, by sawing or otherwise, into blocks or slabs of a rectangular (including square) shape' => 'Dolomit, žgan ali sintran ali ne, vključno z grobo klesanim ali razžaganim ali kako drugače razrezanim v kvadratne ali pravokotne bloke ali plošče',
    'Natural magnesium carbonate (magnesite); fused magnesia; dead-burned (sintered) magnesia, whether or not containing small quantities of other oxides added before sintering; other magnesium oxide, whether or not pure' => 'Naravni magnezijev karbonat (magnezit); taljeni magnezijev oksid; mrtvopečen (sintran) magnezijev oksid z majhnimi količinami drugih oksidov, dodanih pred sintranjem, ali brez njih; drugi magnezijevi oksidi, čisti ali nečisti',
    'Gypsum; anhydrite; plasters (consisting of calcined gypsum or calcium sulphate) whether or not coloured, with or without small quantities of accelerators or retarders' => 'Surova sadra; anhidrid sadre; mavec (ki sestoji iz žgane sadre ali kalcijevega sulfata), barvan ali nebarvan, z majhnimi količinami pospeševalcev ali zaviralcev vezanja ali brez njih',
