    'Portland cement, aluminous cement, slag cement, supersulphate cement and similar hydraulic cements, whether or not coloured or in the form of clinkers' => 'Portlandski cement, aluminatni cement, žlindrani cement, supersulfatni cement in podobni hidravlični cementi, vključno barvane ali v obliki klinkerja',
