    'Prepared pigments, prepared opacifiers and prepared colours, vitrifiable enamels and glazes, engobes (slips), liquid lustres and similar preparations, of a kind used in the ceramic, enamelling or glass industry; glass frit and other glass, in the form of powder, granules or flakes' => 'Pripravljeni pigmenti, pripravljena sredstva za motnjenje in pripravljanje barve, steklasti emajli in glazure, engobe, tekoče nadglazurne metalne barve (lustres) in podobni preparati, ki se uporabljajo v keramični, emajlni in steklarski industriji; steklena frita in drugo steklo v prahu, zrnih ali luskah',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in a non-aqueous medium; solutions as defined in note 4 to this chapter' => 'Barve in laki na osnovi sintetičnih polimerov ali kemično modificiranih naravnih polimerov, dispergiranih ali raztopljenih v nevodnem mediju; raztopine, opredeljene v opombi 4 k temu poglavju',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in an aqueous medium' => 'Barve in laki na osnovi sintetičnih polimerov ali kemično modificiranih naravnih polimerov, dispergiranih ali raztopljenih v vodnem mediju',
    'Other paints and varnishes (including enamels, lacquers and distempers); prepared water pigments of a kind used for finishing leather' => 'Druge barve in laki (vključno emajli, laki in vodne barve); pigmenti, pripravljeni v vodi, ki se uporabljajo za dodelavo usnja',
    'Pigments (including metallic powders and flakes) dispersed in non-aqueous media, in liquid or paste form, of a kind used in the manufacture of paints (including enamels); stamping foils; dyes and other colouring matter put up in forms or packings for retail sale' => 'Pigmenti (vključno kovinski prah in luske), dispergirani v nevodnih medijih, v tekočem stanju ali v pasti, ki se uporabljajo pri proizvodnji barv (vključno emajlov); tiskarske folije; barvila in druge barvilne snovi, ki so pripravljene v oblikah ali pakiranjih za prodajo na drobno',
    'Artists\', students\' or signboard painters\' colours, modifying tints, amusement colours and the like, in tablets, tubes, jars, bottles, pans or in similar forms or packings' => 'Barve za umetniško slikarstvo, pouk ali za plakate, barve za niansiranje, barve in podobno za razvedrilo in zabavo, v tabletah, tubah, kozarčkih, stekleničkah, skodelicah ali podobnih oblikah ali pakiranjih',
    'Glaziers\' putty, grafting putty, resin cements, caulking compounds and other mastics; painters\' fillings; non-refractory surfacing preparations for façades, indoor walls, floors, ceilings or the like' => 'Steklarski kiti, cepilna smola, smolni cementi, tesnilne mase in drugi kiti, pleskarsko barvarska polnila; preparati za površinsko obdelavo fasad, notranjih zidov, tal, stropov in podobno, ki niso ognjevarni',
    'Printing ink, writing or drawing ink and other inks, whether or not concentrated or solid' => 'Tiskarska črnila, črnila za pisanje ali risanje in druga črnila, vključno nekoncentrirana ali v trdnem stanju',
    'Essential oils (terpeneless or not), including concretes and absolutes; resinoids; extracted oleoresins; concentrates of essential oils in fats, in fixed oils, in waxes or the like, obtained by enfleurage or maceration; terpenic by-products of the deterpenation of essential oils; aqueous distillates and aqueous solutions of essential oils' => 'Eterična olja (brez terpenov ali s terpeni), vključno ekstrakti z organskim topilom (konkreti) in iz njih pridobljeni ekstrakti z absolutnim alkoholom (absoluti); rezinoidi; ekstrahirane oljne smole; koncentrati eteričnih olj v masteh, nehlapnih oljih, voskih ali podobnem, dobljeni z enfleražo ali z maceracijo; stranski terpenski proizvodi, dobljeni z deterpenacijo eteričnih olj; vodni destilati in vodne raztopine eteričnih olj',
    'Mixtures of odoriferous substances and mixtures (including alcoholic solutions) with a basis of one or more of these substances, of a kind used as raw materials in industry; other preparations based on odoriferous substances, of a kind used for the manufacture of beverages' => 'Mešanice dišav in mešanice (vključno alkoholne raztopine) na osnovi ene ali več teh snovi, ki se uporabljajo kot surovine v industriji; drugi preparati na osnovi dišav, ki se uporabljajo v proizvodnji pijač',
    'Perfumes and toilet waters' => 'Dišave (parfumi) in toaletne vode',
    'Beauty or make-up preparations and preparations for the care of the skin (other than medicaments), including sunscreen or suntan preparations; manicure or pedicure preparations' => 'Izdelki za lepotenje in ličenje ter izdelki za nego kože (razen zdravil), vključno preparati za zaščito pred soncem ali za pojačenje pigmentacije pri sončenju oziroma porjavenje; in preparati za manikiranje in pedikiranje',
    'Preparations for use on the hair' => 'Preparati za lase',
    'Preparations for oral or dental hygiene, including denture fixative pastes and powders; yarn used to clean between the teeth (dental floss), in individual retail packages' => 'Preparati za higieno ust in zob, vključno s praški in pastami za pritrjevanje protez; nitke za čiščenje zob, v posameznih pakiranjih za prodajo na drobno',
    'Pre-shave, shaving or aftershave preparations, personal deodorants, bath preparations, depilatories and other perfumery, cosmetic or toilet preparations, not elsewhere specified or included; prepared room deodorisers, whether or not perfumed or having disinfectant properties' => 'Preparati za britje, vključno s preparati za uporabo pred britjem in po njem, dezodoranti za osebno nego, preparati za kopanje, depilatorji ter drugi parfumerijski, kozmetični ali toaletni preparati, ki niso navedeni in ne zajeti na drugem mestu; pripravljeni dezodoranti za prostore, parfumirani ali neparfumirani, vključno s tistimi z dezinfekcijskimi lastnostmi',
    'Soap; organic surface-active products and preparations for use as soap, in the form of bars, cakes, moulded pieces or shapes, whether or not containing soap; organic surface-active products and preparations for washing the skin, in the form of liquid or cream and put up for retail sale, whether or not containing soap; paper, wadding, felt and nonwovens, impregnated, coated or covered with soap or detergent' => 'Milo; organski površinsko aktivni proizvodi in preparati, ki se uporabljajo kot milo, v obliki paličic, kolutov, litih ali oblikovanih kosov, ki vsebujejo milo ali ne; organski površinsko aktivni proizvodi in preparati za umivanje kože, v obliki tekočine ali kreme, pakirani v embalaži za prodajo na drobno, ki vsebujejo milo ali ne; papir, vata, polst in netkan tekstil, impregnirani ali premazani z milom ali detergentom',
    'Organic surface-active agents (other than soap); surface-active preparations, washing preparations (including auxiliary washing preparations) and cleaning preparations, whether or not containing soap, other than those of heading 3401' => 'Organske površinsko aktivne snovi (razen mil); površinsko aktivni preparati, preparati za pranje (vključno pomožni preparati za pranje) in preparati za čiščenje, ki vsebujejo milo ali ne, razen tistih iz tarifne številke 3401',
    'Lubricating preparations (including cutting-oil preparations, bolt or nut release preparations, anti-rust or anti-corrosion preparations and mould-release preparations, based on lubricants) and preparations of a kind used for the oil or grease treatment of textile materials, leather, furskins or other materials, but excluding preparations containing, as basic constituents, 70 % or more by weight of petroleum oils or of oils obtained from bituminous minerals' => 'Mazalni preparati (vključno rezalna olja, preparati za popuščanje vijakov in matic, preparati zoper rjo in korozijo ter preparati za ločevanje kalupov na osnovi mazalnih sredstev) ter preparati, ki se uporabljajo za pooljitev in maščenje tekstilnih materialov, usnja, krzna ali drugih materialov, toda brez preparatov, ki kot osnovne sestavine vsebujejo 70 mas. % ali več olj iz nafte ali olj, dobljenih iz bituminoznih mineralov',
    'Artificial waxes and prepared waxes' => 'Umetni voski in pripravljeni voski',
    'Polishes and creams, for footwear, furniture, floors, coachwork, glass or metal, scouring pastes and powders and similar preparations (whether or not in the form of paper, wadding, felt, nonwovens, cellular plastics or cellular rubber, impregnated, coated or covered with such preparations), excluding waxes of heading 3404' => 'Loščila in kreme za obutev, pohištvo, tla, karoserije, steklo ali kovine, paste in praški za čiščenje in podobni preparati (ne glede na to, ali so v obliki papirja, vate, polsti, netkanega tekstila, celičastih materialov, iz plastike ali gume, impregnirani ali premazani s takimi preparati), razen voskov iz tarifne številke 3404',
    'Casein, caseinates and other casein derivatives; casein glues' => 'Kazein, kazeinati in drugi kazeinski derivati; kazeinska lepila',
    'Albumins (including concentrates of two or more whey proteins, containing by weight more than 80 % whey proteins, calculated on the dry matter), albuminates and other albumin derivatives' => 'Albumini (vključno koncentrati dveh ali več proteinov iz sirotke z vsebnostjo 80 mas. % ali več proteinov iz sirotke, računano na suho snov), albuminati in drugi albuminski derivati',
    'Gelatin (including gelatin in rectangular (including square) sheets, whether or not surface-worked or coloured) and gelatin derivatives; isinglass; other glues of animal origin, excluding casein glues of heading 3501' => 'Želatina (vključno z želatino v pravokotnih (vključno kvadratnih) listih, po površini obdelano ali ne ali barvano) in njeni derivati; želatina iz ribjih mehurjev; druga lepila živalskega izvora, razen kazeinskih lepil iz tarifne številke 3501',
    'Peptones and their derivatives; other protein substances and their derivatives, not elsewhere specified or included; hide powder, whether or not chromed' => 'Peptoni in njihovi derivati; druge proteinske snovi in njihovi derivati, ki niso navedeni ali zajeti na drugem mestu; prah iz kož, strojenih s kromom ali ne',
    'Dextrins and other modified starches (for example, pregelatinised or esterified starches); glues based on starches, or on dextrins or other modified starches' => 'Dekstrini in drugi modificirani škrobi (npr. preželatinizirani ali estrificirani škrobi); lepila na osnovi škrobov ali na osnovi dekstrinov in drugih modificiranih škrobov',
    'Prepared glues and other prepared adhesives, not elsewhere specified or included; products suitable for use as glues or adhesives, put up for retail sale as glues or adhesives, not exceeding a net weight of 1 kg' => 'Pripravljena lepila in druga pripravljena sredstva za lepljenje, ki niso navedena in ne zajeta na drugem mestu; proizvodi, ki so primerni za uporabo kot lepila ali sredstva za lepljenje, pripravljeni za prodajo na drobno kot lepila ali sredstva za lepljenje, v pakiranjih do vključno 1 kg neto mase',
    'Enzymes; prepared enzymes not elsewhere specified or included' => 'Encimi; pripravljeni encimi, ki niso navedeni in ne zajeti na drugem mestu',
    'Safety fuses; detonating cords; percussion or detonating caps; igniters; electric detonators' => 'Vžigalne vrvice; detonacijske vrvice; inicialne ali detonacijske kapice; vžigalniki; električni detonatorji',
    'Fireworks, signalling flares, rain rockets, fog signals and other pyrotechnic articles' => 'Pirotehnični proizvodi za ognjemete, signalne rakete, rakete proti toči, signalne rakete za gosto meglo in drugi pirotehnični proizvodi',
    'Ferro-cerium and other pyrophoric alloys in all forms; articles of combustible materials as specified in note 2 to this chapter' => 'Ferocerij in druge piroforne zlitine v vseh oblikah; izdelki iz vnetljivih snovi, navedeni v opombi 2 k temu poglavju',
    'Photographic plates and film in the flat, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in the flat, sensitised, unexposed, whether or not in packs' => 'Fotografske plošče in plan filmi, občutljivi za svetlobo, neosvetljeni, iz kakršnega koli materiala, razen iz papirja, kartona ali tekstila; plan filmi za trenutno (hitro) fotografijo, občutljivi na svetlobo, neosvetljeni, v kasetah ali brez njih',
    'Photographic film in rolls, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in rolls, sensitised, unexposed' => 'Fotografski filmi v zvitkih, občutljivi na svetlobo, neosvetljeni, iz kakršnega koli materiala, razen iz papirja, kartona ali tekstila; filmi v zvitkih za trenutne (hitre) fotografije, občutljivi na svetlobo, neosvetljeni',
    'Photographic paper, paperboard and textiles, sensitised, unexposed' => 'Fotografski papir, karton in tekstil, občutljivi na svetlobo, neosvetljeni',
