    'Photographic plates and film, exposed and developed, other than cinematographic film' => 'Fotografske plošče in filmi, osvetljeni in razviti, razen kinematografskih filmov',
    'Cinematographic film, exposed and developed, whether or not incorporating soundtrack or consisting only of soundtrack' => 'Kinematografski filmi, osvetljeni in razviti, s posnetim zvočnim zapisom ali brez njega ali samo s posnetim zvočnim zapisom',
    'Chemical preparations for photographic uses (other than varnishes, glues, adhesives and similar preparations); unmixed products for photographic uses, put up in measured portions or put up for retail sale in a form ready for use' => 'Kemični preparati za fotografske namene (razen lakov, lepil, sredstev za lepljenje in podobnih preparatov); nepomešani proizvodi za fotografsko uporabo, pripravljeni v odmerjene količine ali pripravljeni za prodajo na drobno v gotovi obliki',
    'Artificial graphite; colloidal or semi-colloidal graphite; preparations based on graphite or other carbon in the form of pastes, blocks, plates or other semi-manufactures' => 'Umetni grafit, koloidni ali polkoloidni grafit; preparati na osnovi grafita ali drugih vrst ogljika v obliki paste, blokov, plošč in drugih polizdelkov',
    'Activated carbon; activated natural mineral products; animal black, including spent animal black' => 'Aktivno oglje; aktivirani naravni mineralni proizvodi; živalsko oglje, vključno rabljeno živalsko oglje',
    'Tall oil, whether or not refined' => 'Talovo olje, surovo ali rafinirano',
    'Gum, wood or sulphate turpentine and other terpenic oils produced by the distillation or other treatment of coniferous woods; crude dipentene; sulphite turpentine and other crude para-cymene; pine oil containing alpha-terpineol as the main constituent' => 'Smolni, lesni ali sulfatni terpentin ter druga terpentinova olja, dobljena z destilacijo ali po drugačnem postopku iz lesa iglavcev; surovi dipenten; sulfitni terpentin in drugi surovi paracimeni; borovo olje, ki vsebuje alfa-terpineol kot glavno sestavino',
    'Rosin and resin acids, and derivatives thereof; rosin spirit and rosin oils; run gums' => 'Kolofonija in druge smolne kisline ter njihovi derivati; kolofonijski špirit in kolofonijska olja; staljene smole',
