    'Insecticides, rodenticides, fungicides, herbicides, anti-sprouting products and plant-growth regulators, disinfectants and similar products, put up in forms or packings for retail sale or as preparations or articles (for example, sulphur-treated bands, wicks and candles, and fly-papers)' => 'Insekticidi, rodenticidi, fungicidi, herbicidi, sredstva zoper klitje, rastni regulatorji rastlin, dezinfektanti in podobni proizvodi, pripravljeni v oblikah ali pakiranjih za prodajo na drobno ali kot preparati ali proizvodi (npr. žveplani trakovi, stenji, sveče in muholovke)',
    'Finishing agents, dye carriers to accelerate the dyeing or fixing of dyestuffs and other products and preparations (for example, dressings and mordants), of a kind used in the textile, paper, leather or like industries, not elsewhere specified or included' => 'Sredstva za dodelavo, nosilci barv, sredstva za pospeševanje barvanja in fiksiranja barvil ter drugi proizvodi (npr. sredstva za apreturo in jedkanje), ki se uporabljajo v tekstilni, papirni, usnjarski in podobnih industrijah, ki niso navedeni ali zajeti na drugem mestu',
    'Pickling preparations for metal surfaces; fluxes and other auxiliary preparations for soldering, brazing or welding; soldering, brazing or welding powders and pastes consisting of metal and other materials; preparations of a kind used as cores or coatings for welding electrodes or rods' => 'Preparati za dekapiranje kovinskih površin; talila in drugi pomožni preparati za mehko spajkanje in trdo spajkanje ali varjenje; praški in paste za spajkanje in varjenje, ki so sestavljeni iz kovin in drugih materialov; preparati, ki se uporabljajo kot jedra ali obloge za elektrode ali varilne palice',
    'Anti-knock preparations, oxidation inhibitors, gum inhibitors, viscosity improvers, anti-corrosive preparations and other prepared additives, for mineral oils (including gasoline) or for other liquids used for the same purposes as mineral oils' => 'Preparati proti klenkanju, antioksidanti, preparati za preprečevanje kopičenja smole, za zboljšanje viskoznosti, preparati za preprečevanje korozije in drugi pripravljeni dodatki, za mineralna olja (vključno bencin) ali za druge tekočine, ki se uporabljajo v iste namene kot mineralna olja',
    'Prepared rubber accelerators; compound plasticisers for rubber or plastics, not elsewhere specified or included; anti-oxidising preparations and other compound stabilisers for rubber or plastics' => 'Pripravljeni pospeševalci vulkanizacije, sestavljeni plastifikatorji za gumo in plastične mase, ki niso navedeni in ne zajeti na drugem mestu, antioksidanti (protioksidacijski preparati) in drugi sestavljeni stabilizatorji za gumo ali plastične mase',
    'Organic composite solvents and thinners, not elsewhere specified or included; prepared paint or varnish removers' => 'Sestavljena organska topila in razredčila, ki niso navedena in ne zajeta na drugem mestu; pripravljena sredstva za odstranjevanje premazov ali lakov',
    'Reaction initiators, reaction accelerators and catalytic preparations, not elsewhere specified or included' => 'Pobudniki reakcije, pospeševalci reakcije in katalitični preparati, ki niso navedeni ali zajeti na drugem mestu',
    'Refractory cements, mortars, concretes and similar compositions, including dolomite ramming mix, other than products of heading 3801' => 'Ognjevarni cementi, ognjevarne malte, ognjevarni betoni in podobne ognjevarne mase, vključno dolomitne nabijalne mešanice, razen proizvodov iz tarifne številke 3801',
    'Mixed alkylbenzenes and mixed alkylnaphthalenes, other than those of heading 2707 or 2902' => 'Mešani alkilbenzeni in mešani alkilnaftaleni, razen tistih iz tarifne številke 2707 ali 2902',
    'Chemical elements doped for use in electronics, in the form of discs, wafers or similar forms; chemical compounds doped for use in electronics' => 'Kemični elementi, dopirani za uporabo v elektroniki, v obliki kolutov, ploščic ali v podobnih oblikah; kemične spojine, dopirane za uporabo v elektroniki',
    'Diagnostic or laboratory reagents on a backing, prepared diagnostic or laboratory reagents whether or not on a backing, whether or not put up in the form of kits, other than those of heading 3006; certified reference materials' => 'Diagnostični ali laboratorijski reagenti na podlogi (nosilcu); pripravljeni diagnostični ali laboratorijski reagenti na nosilcu ali brez njega, v obliki kompleta ali ne, razen tistih iz tarifne številke 3006; certificirani referenčni materiali',
    'Industrial monocarboxylic fatty acids; acid oils from refining; industrial fatty alcohols' => 'Industrijske maščobne monokarboksilne kisline; kislinska olja iz rafinacije; industrijski maščobni alkoholi',
