    'Residual products of the chemical or allied industries, not elsewhere specified or included; municipal waste; sewage sludge; other wastes specified in note 6 to this chapter' => 'Ostanki iz proizvodnje kemijske industrije ali sorodnih industrij, ki niso navedeni in ne zajeti na drugem mestu; komunalni odpadki; kanalizacijsko blato; drugi odpadki navedeni v opombi 6 k temu poglavju',
    'Biodiesel and mixtures thereof, not containing or containing less than 70 % by weight of petroleum oils or oils obtained from bituminous minerals' => 'Biodizel in njegove zmesi, ki ne vsebujejo ali vsebujejo manj kot 70 mas. % olj iz nafte ali olj, dobljenih iz bituminoznih mineralov',
    'Mixtures containing halogenated derivatives of methane, ethane or propane, not elsewhere specified or included' => 'Mešanice, ki vsebujejo halogenirane derivate metana, etana ali propana, ki niso navedene ali zajete na drugem mestu',
    'Polymers of ethylene, in primary forms' => 'Polimeri etilena, v primarnih oblikah',
    'Polymers of propylene or of other olefins, in primary forms' => 'Polimeri propilena ali drugih olefinov, v primarnih oblikah',
    'Polymers of styrene, in primary forms' => 'Polimeri stirena, v primarnih oblikah',
    'Polymers of vinyl chloride or of other halogenated olefins, in primary forms' => 'Polimeri vinilklorida ali drugih halogeniranih olefinov, v primarnih oblikah',
    'Polymers of vinyl acetate or of other vinyl esters, in primary forms; other vinyl polymers in primary forms' => 'Polimeri vinilacetata ali drugih vinilestrov, v primarnih oblikah; drugi polimeri vinila, v primarnih oblikah',
    'Acrylic polymers in primary forms' => 'Akrilni polimeri v primarnih oblikah',
    'Polyacetals, other polyethers and epoxide resins, in primary forms; polycarbonates, alkyd resins, polyallyl esters and other polyesters, in primary forms' => 'Poliacetali, drugi polietri in epoksidne smole, v primarnih oblikah; polikarbonati, alkidne smole, polialil estri in drugi poliestri, v primarnih oblikah',
    'Polyamides in primary forms' => 'Poliamidi (PA), v primarnih oblikah',
    'Amino-resins, phenolic resins and polyurethanes, in primary forms' => 'Amino smole, fenolne smole in poliuretani, v primarnih oblikah',
    'Petroleum resins, coumarone-indene resins, polyterpenes, polysulphides, polysulphones and other products specified in note 3 to this chapter, not elsewhere specified or included, in primary forms' => 'Naftne smole, kumaron-inden smole, politerpeni, polisulfidi, polisulfoni in drugi proizvodi, navedeni v opombi 3 k temu poglavju, ki niso navedeni in ne zajeti na drugem mestu, v primarnih oblikah',
    'Cellulose and its chemical derivatives, not elsewhere specified or included, in primary forms' => 'Celuloza in njeni kemični derivati, ki niso navedeni ali zajeti na drugem mestu, v primarnih oblikah',
    'Natural polymers (for example, alginic acid) and modified natural polymers (for example, hardened proteins, chemical derivatives of natural rubber), not elsewhere specified or included, in primary forms' => 'Naravni polimeri (npr. alginska kislina) in modificirani naravni polimeri (npr. utrjene beljakovine, kemični derivati naravnega kavčuka), ki niso navedeni ali zajeti na drugem mestu, v primarnih oblikah',
    'Waste, parings and scrap, of plastics' => 'Odpadki, ostružki in ostanki iz plastičnih mas',
    'Monofilament of which any cross-sectional dimension exceeds 1 mm, rods, sticks and profile shapes, whether or not surface-worked but not otherwise worked, of plastics' => 'Monofilamenti, katerih kateri koli premer presega 1 mm, palice, paličice in profilne oblike iz plastičnih mas, površinsko obdelane ali ne, toda drugače neobdelane',
    'Tubes, pipes and hoses, and fittings therefor (for example, joints, elbows, flanges), of plastics' => 'Cevi, gibke cevi in pribor zanje (npr. spojke, kolena, prirobnice) iz plastičnih mas',
    'Floor coverings of plastics, whether or not self-adhesive, in rolls or in the form of tiles; wall or ceiling coverings of plastics, as defined in note 9 to this chapter' => 'Talne obloge iz plastičnih mas, samolepilne ali ne, v zvitkih ali v ploščah; tapete za stene ali strope, opredeljene z opombo 9 k temu poglavju',
    'Self-adhesive plates, sheets, film, foil, tape, strip and other flat shapes, of plastics, whether or not in rolls' => 'Samolepilne plošče, listi, filmi, folije, trakovi in druge podobne ploščate oblike iz plastičnih mas, vključno tudi tiste v zvitkih',
    'Other plates, sheets, film, foil and strip, of plastics, non-cellular and not reinforced, laminated, supported or similarly combined with other materials' => 'Druge plošče, listi, filmi, folije in trakovi iz plastičnih mas, ki nimajo celičaste strukture in so neojačani, nelaminirani, brez podloge, ali ki niso na podoben način kombinirani z drugimi materiali',
    'Other plates, sheets, film, foil and strip, of plastics' => 'Druge plošče, listi, filmi, folije in trakovi iz plastičnih mas',
    'Baths, shower-baths, sinks, washbasins, bidets, lavatory pans, seats and covers, flushing cisterns and similar sanitary ware, of plastics' => 'Kadi, pršne kadi, umivalniki, pomivalna korita, bideji, straniščne školjke, deske in pokrovi, izplakovalni kotliči in podobni sanitarni proizvodi, iz plastičnih mas',
    'Articles for the conveyance or packing of goods, of plastics; stoppers, lids, caps and other closures, of plastics' => 'Izdelki za prevoz ali pakiranje blaga (embalaža), iz plastičnih mas; zamaški, pokrovi, poklopci in druga zapirala, iz plastičnih mas',
    'Tableware, kitchenware, other household articles and hygienic or toilet articles, of plastics' => 'Namizna posoda in pribor, kuhinjska posoda in pribor in drugi gospodinjski izdelki in higienski ali toaletni izdelki, iz plastičnih mas',
    'Builders\' ware of plastics, not elsewhere specified or included' => 'Gradbeni proizvodi iz plastičnih mas, ki niso navedeni ali zajeti na drugem mestu',
    'Other articles of plastics and articles of other materials of headings 3901 to 3914' => 'Drugi proizvodi iz plastičnih mas in proizvodi iz drugih materialov iz tarifnih številk 3901 do 3914',
    'Natural rubber, balata, gutta-percha, guayule, chicle and similar natural gums, in primary forms or in plates, sheets or strip' => 'Naravni kavčuk, balata, gutaperča, gvajala, čikl in podobne naravne gume, v primarnih oblikah ali ploščah, listih ali trakovih – nevulkanizirani',
    'Synthetic rubber and factice derived from oils, in primary forms or in plates, sheets or strip; mixtures of any product of heading 4001 with any product of this heading, in primary forms or in plates, sheets or strip' => 'Sintetični kavčuk in faktis, dobljena iz olja, v primarnih oblikah ali ploščah, listih ali trakovih; mešanice katerega koli proizvoda iz tarifne številke 4001 s katerim koli proizvodom iz te tarifne številke, v primarnih oblikah ali ploščah, listih ali trakovih',
    'Compounded rubber, unvulcanised, in primary forms or in plates, sheets or strip' => 'Mešanice kavčuka, nevulkanizirane, v primarnih oblikah ali ploščah, v listih ali trakovih',
    'Other forms (for example, rods, tubes and profile shapes) and articles (for example, discs and rings), of unvulcanised rubber' => 'Druge oblike (npr.: palice, cevi in profili) in proizvodi (npr.: koluti in obroči) iz nevulkaniziranega kavčuka',
    'Plates, sheets, strip, rods and profile shapes, of vulcanised rubber other than hard rubber' => 'Plošče, listi, trakovi, palice in profili iz vulkaniziranega kavčuka (gume), razen iz trde gume',
    'Tubes, pipes and hoses, of vulcanised rubber other than hard rubber, with or without their fittings (for example, joints, elbows, flanges)' => 'Cevi iz vulkaniziranega kavčuka (gume), razen iz trde gume, s priborom ali brez njega (npr. spojke, kolena, prirobnice)',
    'Conveyor or transmission belts or belting, of vulcanised rubber' => 'Trakovi ali jermeni iz vulkaniziranega kavčuka (gume) za transport ali transmisijo',
    'New pneumatic tyres, of rubber' => 'Nove pnevmatike, iz gume',
    'Retreaded or used pneumatic tyres of rubber; solid or cushion tyres, tyre treads and tyre flaps, of rubber' => 'Protektirane ali rabljene pnevmatike, iz gume; polne pnevmatike ali pnevmatike z zračnimi komorami, zamenljive tekalne plasti in obodni trakovi platišč:',
    'Inner tubes, of rubber' => 'Zračnice iz gume',
    'Hygienic or pharmaceutical articles (including teats), of vulcanised rubber other than hard rubber, with or without fittings of hard rubber' => 'Higienski ali farmacevtski izdelki (vključno s cuclji), iz vulkaniziranega kavčuka (gume), razen iz trde gume, s priborom ali brez, iz trde gume',
    'Articles of apparel and clothing accessories (including gloves, mittens and mitts), for all purposes, of vulcanised rubber other than hard rubber' => 'Oblačilni predmeti in pribor za oblačila (vključno rokavice, palčniki in rokavice brez prstov) za vse namene, iz vulkaniziranega kavčuka (gume), razen trde gume',
    'Other articles of vulcanised rubber other than hard rubber' => 'Drugi izdelki iz vulkaniziranega kavčuka (gume), razen iz trde gume',
    'Raw hides and skins of bovine (including buffalo) or equine animals (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split' => 'Surove kože, kože govedi (vključno bivolov) ali kopitarjev (sveže ali nasoljene, sušene, lužene, piklane ali drugače konzervirane, toda nestrojene niti pergamentno obdelane niti nadalje obdelane), z dlako ali brez dlake, cepljene ali necepljene',
    'Raw skins of sheep or lambs (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not with wool on or split, other than those excluded by note 1(c) to this chapter' => 'Surove kože ovac ali jagnjet (sveže ali nasoljene, sušene, lužene, piklane ali drugače konzervirane, toda nestrojene, pergamentno neobdelane in tudi ne kako drugače naprej obdelane), z volno ali brez nje, cepljene ali necepljene, razen tistih, ki so izključene z opombo 1(c) k temu poglavju',
    'Other raw hides and skins (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split, other than those excluded by note 1(b) or 1(c) to this chapter' => 'Druge surove kože (sveže ali nasoljene, sušene, lužene, piklane ali drugače konzervirane, toda nestrojene in pergamentno neobdelane ali nadalje obdelane), z dlako ali brez dlake, cepljene ali necepljene, razen tistih, ki so izključene z opombo 1(b) ali (c) k temu poglavju',
    'Tanned or crust hides and skins of bovine (including buffalo) or equine animals, without hair on, whether or not split, but not further prepared' => 'Strojene ali crust kože goved (vključno bivolov) ali kopitarjev, brez dlake, cepljene ali necepljene, toda nadalje neobdelane',
    'Tanned or crust skins of sheep or lambs, without wool on, whether or not split, but not further prepared' => 'Strojene ali crust kože ovac ali jagnjet brez volne, cepljene ali necepljene, toda nadalje neobdelane',
    'Tanned or crust hides and skins of other animals, without wool or hair on, whether or not split, but not further prepared' => 'Strojene ali crust kože drugih živali, brez dlake ali volne, cepljene ali necepljene, toda nadalje neobdelane',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of bovine (including buffalo) or equine animals, without hair on, whether or not split, other than leather of heading 4114' => 'Usnje, nadalje obdelano po strojenju ali crust obdelavi, vključno pergamentno obdelano, goved (vključno bivolov) ali kopitarjev, brez dlak, cepljeno ali necepljeno, razen usnja iz tarifne številke 4114',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of other animals, without wool or hair on, whether or not split, other than leather of heading 4114' => 'Usnje, nadalje obdelano po strojenju ali crust obdelavi, vključno pergamentno obdelano, drugih živali, brez volne ali dlake, cepljeno ali necepljeno, razen usnja iz tarifne številke 4114',
    'Chamois (including combination chamois) leather; patent leather and patent laminated leather; metallised leather' => 'Semiš usnje (vključno s kombinacijo semiš usnja); lakasto usnje in lakasto plastovito usnje; metalizirano usnje',
    'Composition leather with a basis of leather or leather fibre, in slabs, sheets or strip, whether or not in rolls; parings and other waste of leather or of composition leather, not suitable for the manufacture of leather articles; leather dust, powder and flour' => 'Sestavljeno usnje na osnovi usnja ali usnjenih vlaken v ploščah, listih ali trakovih, tudi v zvitkih; obrezki in drugi ostanki usnja ali sestavljenega usnja, neprimerni za proizvodnjo usnjenih izdelkov; prah in moka iz usnja',
    'Trunks, suitcases, vanity cases, executive-cases, briefcases, school satchels, spectacle cases, binocular cases, camera cases, musical instrument cases, gun cases, holsters and similar containers; travelling-bags, insulated food or beverages bags, toilet bags, rucksacks, handbags, shopping-bags, wallets, purses, map-cases, cigarette-cases, tobacco-pouches, tool bags, sports bags, bottle-cases, jewellery boxes, powder boxes, cutlery cases and similar containers, of leather or of composition leather, of sheeting of plastics, of textile materials, of vulcanised fibre or of paperboard, or wholly or mainly covered with such materials or with paper' => 'Potovalni kovčki, ročni kovčki, kozmetični kovčki, poslovni kovčki, aktovke, šolske torbe, etuiji za očala, toki za daljnoglede, toki za fotoaparate, toki za glasbila, toki za puške, toki za samokrese in podobni izdelki; potovalke, izolirane torbe za hrano ali pijačo, toaletne torbice, nahrbtniki, ročne torbice, nakupovalne torbe, listnice, denarnice za kovance, tulci in mape za zemljevide, tobačnice, mošnjički za tobak, torbe za orodje, športne torbe, škatle za steklenice, škatle za nakit, pudrnice, škatle za jedilni pribor in podobne škatle iz usnja, sestavljenega usnja, plastičnih folij, tekstilnih materialov, vulkanfibra ali kartona, ali v celoti ali pretežno prevlečeni s temi materiali ali papirjem',
    'Articles of apparel and clothing accessories, of leather or of composition leather' => 'Oblačila in oblačilni dodatki, iz usnja ali sestavljenega usnja',
    'Other articles of leather or of composition leather' => 'Drugi proizvodi iz usnja ali sestavljenega usnja',
    'Raw furskins (including heads, tails, paws and other pieces or cuttings, suitable for furriers\' use), other than raw hides and skins of heading 4101, 4102 or 4103' => 'Surovo nestrojeno krzno (vključno z glavami, repi, tacami in drugimi kosi ali odrezki, primernimi za krznarsko rabo), razen surovih kož, ki se uvrščajo pod tarifno številko 4101, 4102 ali 4103',
    'Tanned or dressed furskins (including heads, tails, paws and other pieces or cuttings), unassembled, or assembled (without the addition of other materials) other than those of heading 4303' => 'Strojeno ali obdelano krzno (vključno z glavami, repi, tacami ali drugimi kosi ali odrezki), nesestavljeno ali sestavljeno (brez dodajanja drugih materialov), razen tistega, ki se uvršča pod tarifno številko 4303',
    'Articles of apparel, clothing accessories and other articles of furskin' => 'Oblačila, oblačilni dodatki in drugi krzneni izdelki',
    'Fuel wood, in logs, in billets, in twigs, in faggots or in similar forms; wood in chips or particles; sawdust and wood waste and scrap, whether or not agglomerated in logs, briquettes, pellets or similar forms' => 'Les za ogrevanje v hlodih, polenih, vejah, butarah ali podobnih oblikah; iver in podobni drobci; žagovina, lesni odpadki in ostanki, aglomerirani ali neaglomerirani v hlode, brikete, pelete ali podobne oblike',
