    'Wood in the rough, whether or not stripped of bark or sapwood, or roughly squared' => 'Les, neobdelan, z lubjem ali brez lubja ali beljavine, ali grobo obdelan (obtesan)',
    'Hoopwood; split poles; piles, pickets and stakes of wood, pointed but not sawn lengthwise; wooden sticks, roughly trimmed but not turned, bent or otherwise worked, suitable for the manufacture of walking sticks, umbrellas, tool handles or the like; chipwood and the like' => 'Les za obroče; cepljeni koli; koli, planke in drogovi, zašiljeni, toda ne žagani po dolžini; lesene palice, grobo okleščene, toda ne zvite, upognjene ali drugače obdelane, primerne za izdelavo sprehajalnih palic, dežnikov, ročajev za orodje ali podobnih proizvodov; trakovi in podobno iz lesa',
    'Railway or tramway sleepers (cross-ties) of wood' => 'Leseni železniški ali tramvajski pragovi',
    'Wood sawn or chipped lengthwise, sliced or peeled, whether or not planed, sanded or end-jointed, of a thickness exceeding 6 mm' => 'Les, vzdolžno žagan ali rezan, cepljen ali luščen, skobljan ali ne, brušen ali ne ali vzdolžno spojen ali ne, debeline nad 6 mm',
    'Sheets for veneering (including those obtained by slicing laminated wood), for plywood or for similar laminated wood and other wood, sawn lengthwise, sliced or peeled, whether or not planed, sanded, spliced or end-jointed, of a thickness not exceeding 6 mm' => 'Listi za furniranje (vključno s tistimi, ki so pridobljeni z rezanjem slojnatega lesa), za vezan les ali podoben slojnati les in drug les, vzdolžno žagan, rezan ali luščen, skobljan ali ne, brušen ali ne, prstasto spojen ali ne, vzdolžno spojen ali ne, debeline do vključno 6 mm',
    'Wood (including strips and friezes for parquet flooring, not assembled) continuously shaped (tongued, grooved, rebated, chamfered, V-jointed, beaded, moulded, rounded or the like) along any of its edges, ends or faces, whether or not planed, sanded or end-jointed' => 'Les (vključno lamele in frize za parket, nesestavljene), kontinuirano oblikovan (s peresom in utorom, brazdan, s posnetimi robovi, spojen na utor in pero (V-spojen), profiliran, oblikovan, zaobljen ali podobno) vzdolž katerega koli roba, konca ali strani, skobljan ali ne, brušen ali ne, ali vzdolžno spojen ali ne',
    'Particle board, oriented strand board (OSB) and similar board (for example, waferboard) of wood or other ligneous materials, whether or not agglomerated with resins or other organic binding substances' => 'Iverne plošče, plošče z usmerjenim ploščatim iverjem (OSB) in podobne plošče (npr. oblatne plošče) iz lesa in drugih lesnih materialov, neaglomerirane ali aglomerirane s smolami ali drugimi organskimi vezivi',
    'Fibreboard of wood or other ligneous materials, whether or not bonded with resins or other organic substances' => 'Vlaknene plošče iz lesa ali drugih lesnih materialov, aglomerirane ali neaglomerirane s smolami ali drugimi organskimi vezivi',
    'Plywood, veneered panels and similar laminated wood' => 'Vezane lesene plošče, furnirane plošče in podoben slojnati les',
    'Wooden frames for paintings, photographs, mirrors or similar objects' => 'Leseni okvirji za slike, fotografije, ogledala in podobne predmete',
    'Packing cases, boxes, crates, drums and similar packings, of wood; cable-drums of wood; pallets, box pallets and other load boards, of wood; pallet collars of wood' => 'Zaboji za pakiranje, škatle, gajbe, sodi in podobna embalaža za pakiranje, iz lesa; koluti (tulci) za kable iz lesa; palete, zabojaste palete in druge nakladalne plošče iz lesa; paletne prirobnice iz lesa',
    'Builders\' joinery and carpentry of wood, including cellular wood panels, assembled flooring panels, shingles and shakes' => 'Stavbno pohištvo in drugi leseni proizvodi za gradbeništvo, vključno celičaste lesene plošče, sestavljene plošče za oblaganje tal, žagane in klane skodle',
    'Tableware and kitchenware, of wood' => 'Lesena namizna in kuhinjska posoda in pribor',
    'Wood marquetry and inlaid wood; caskets and cases for jewellery or cutlery, and similar articles, of wood; statuettes and other ornaments, of wood; wooden articles of furniture not falling in Chapter 94' => 'Marketerija in intarzija iz lesa; skrinjice in škatle za nakit, za jedilni pribor in podobni leseni izdelki, leseni kipci in drugi leseni okraski; izdelki za notranjo opremo, ki se ne uvrščajo v poglavje 94, iz lesa',
    'Other articles of wood' => 'Drugi leseni izdelki',
    'Natural cork, raw or simply prepared; waste cork; crushed, granulated or ground cork' => 'Pluta, naravna, surova ali enostavno obdelana; odpadki plute; zdrobljena, drobljena ali zmleta pluta',
    'Articles of natural cork' => 'Izdelki iz naravne plute',
    'Agglomerated cork (with or without a binding substance) and articles of agglomerated cork' => 'Aglomerirana pluta (z vezivi ali brez njih) in izdelki iz aglomerirane plute',
    'Plaits and similar products of plaiting materials, whether or not assembled into strips; plaiting materials, plaits and similar products of plaiting materials, bound together in parallel strands or woven, in sheet form, whether or not being finished articles (for example, mats, matting, screens)' => 'Pletenice in podobni izdelki iz pletarskega materiala, povezani v trakove ali ne; pletarski materiali, pletenice in podobni izdelki iz pletarskega materiala, povezani v vzporedne pramene ali tkani v obliki listov, ne glede na to, ali so dokončani ali nedokončani izdelki (npr. podstavki, pregrinjala in zastirala)',
    'Basketwork, wickerwork and other articles, made directly to shape from plaiting materials or made up from goods of heading 4601; articles of loofah' => 'Košarski, pletarski in podobni izdelki, izdelani neposredno v oblike iz pletarskega materiala ali iz proizvodov, ki se uvrščajo pod tarifno številko 4601; izdelki iz lufe',
    'Mechanical wood pulp' => 'Mehanska lesna celuloza (lesovina)',
    'Chemical wood pulp, soda or sulphate, other than dissolving grades' => 'Kemična lesna celuloza, natronska ali sulfatna, razen za raztapljanje',
    'Chemical wood pulp, sulphite, other than dissolving grades' => 'Kemična lesna celuloza, sulfitna, razen topljive',
    'Pulps of fibres derived from recovered (waste and scrap) paper or paperboard or of other fibrous cellulosic material' => 'Celuloza iz vlaken, dobljenih z reciklažo odpadnega papirja ali kartona ali iz drugih vlaknastih celuloznih materialov',
    'Recovered (waste and scrap) paper or paperboard' => 'Papir ali karton za recikliranje (odpadki in ostanki)',
    'Uncoated paper and paperboard, of a kind used for writing, printing or other graphic purposes, and non-perforated punchcards and punch-tape paper, in rolls or rectangular (including square) sheets, of any size, other than paper of heading 4801 or 4803; handmade paper and paperboard' => 'Nepremazan papir in karton, ki se uporabljata za pisanje, tiskanje ali druge grafične namene, vključno neperforiran papir in karton za luknjane kartice in trakove v zvitkih ali pravokotnih (vključno kvadratnih) listih, katere koli velikosti, razen papirja iz tarifne številke 4801 ali 4803; ročno izdelana papir in karton',
    'Toilet or facial tissue stock, towel or napkin stock and similar paper of a kind used for household or sanitary purposes, cellulose wadding and webs of cellulose fibres, whether or not creped, crinkled, embossed, perforated, surface-coloured, surface-decorated or printed, in rolls or sheets' => 'Toaletni papir, papir za odstranjevanje ličila, papir za brisače, serviete in robce ter podoben papir za uporabo v gospodinjstvu ali za sanitarne namene, celulozna vata, koprene iz celuloznih vlaken, vključno nabrani (krep, plisirani idr.), reliefni, luknjani, površinsko barvani, površinsko okrašeni ali tiskani izdelki, v zvitkih ali listih',
    'Uncoated kraft paper and paperboard, in rolls or sheets, other than that of heading 4802 or 4803' => 'Kraft papir in karton, nepremazana, v zvitkih ali listih, razen tistih iz tarifne številke 4802 ali 4803',
    'Other uncoated paper and paperboard, in rolls or sheets, not further worked or processed than as specified in note 3 to this chapter' => 'Drug nepremazan papir in karton, v zvitkih ali listih, dalje neobdelan, razen obdelav, ki so navedene v opombi 3 tega poglavja',
    'Vegetable parchment, greaseproof papers, tracing papers and glassine and other glazed transparent or translucent papers, in rolls or sheets' => 'Pergamentni papir, za maščobe neprepusten papir, pavs papir in prozorni papir ter drugi glazirani prozorni ali prosojni papirji, v zvitkih ali listih',
    'Composite paper and paperboard (made by sticking flat layers of paper or paperboard together with an adhesive), not surface-coated or impregnated, whether or not internally reinforced, in rolls or sheets' => 'Sestavljena papir in karton (izdelana z lepljenjem ravnih slojev papirja ali kartona), površinsko nepremazana ali neimpregnirana, znotraj ojačena ali neojačena, v zvitkih ali listih',
    'Paper and paperboard, corrugated (with or without glued flat surface sheets), creped, crinkled, embossed or perforated, in rolls or sheets, other than paper of the kind described in heading 4803' => 'Papir in karton, valovita (z nalepljenimi ravnimi površinskimi listi ali brez njih), nabrana (krep, plisirana), reliefna ali luknjana, v zvitkih ali listih, razen tistih iz tarifne številke 4803',
    'Carbon paper, self-copy paper and other copying or transfer papers (including coated or impregnated paper for duplicator stencils or offset plates), whether or not printed, in rolls or sheets' => 'Karbon papir, samokopirni papir in drug papir za kopiranje ali prenašanje (vključno premazan ali impregniran papir za razmnoževalne matrice ali ofsetne plošče), tiskan ali netiskan, v zvitkih ali listih',
    'Paper and paperboard, coated on one or both sides with kaolin (China clay) or other inorganic substances, with or without a binder, and with no other coating, whether or not surface-coloured, surface-decorated or printed, in rolls or rectangular (including square) sheets, of any size' => 'Papir in karton, premazana z ene ali z obeh strani s kaolinom ali drugimi anorganskimi snovmi, z vezivom ali brez njega, toda brez drugega premaza, površinsko barvana ali nebarvana, okrašena ali neokrašena, tiskana ali netiskana, v zvitkih ali pravokotnih (vključno kvadratnih) listih, katere koli velikosti',
