    'Aluminium structures (excluding prefabricated buildings of heading 9406) and parts of structures (for example, bridges and bridge-sections, towers, lattice masts, roofs, roofing frameworks, doors and windows and their frames and thresholds for doors, balustrades, pillars and columns); aluminium plates, rods, profiles, tubes and the like, prepared for use in structures' => 'Konstrukcije (razen montažnih zgradb iz tarifne številke 9406) in deli konstrukcij (npr.: mostovi in deli mostov, stolpi, predalčni stebri, strehe, strešna ogrodja, vrata in okna ter okvirji zanje, pragovi za vrata, ograje in stebri) iz aluminija; pločevine, palice, profili, cevi in podobno, iz aluminija, pripravljeni za uporabo v konstrukcijah',
    'Aluminium casks, drums, cans, boxes and similar containers (including rigid or collapsible tubular containers), for any material (other than compressed or liquefied gas), of a capacity not exceeding 300 litres, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Sodi, bobni, pločevinke, škatle in podobni vsebniki (tudi togi in upogljivi cevasti vsebniki), iz aluminija, za kakršno koli snov (razen komprimiranih ali utekočinjenih plinov), s prostornino največ 300 litrov, z oblogo ali brez nje, s toplotno izolacijo ali brez nje, toda brez mehaničnih ali termičnih naprav',
    'Stranded wire, cables, plaited bands and the like, of aluminium, not electrically insulated' => 'Vpredena žica, vrvi, pleteni trakovi ipd. iz aluminija, električno neizolirani',
    'Table, kitchen or other household articles and parts thereof, of aluminium; pot scourers and scouring or polishing pads, gloves and the like, of aluminium; sanitary ware and parts thereof, of aluminium' => 'Namizni, kuhinjski in drugi izdelki za gospodinjstvo in njihovi deli iz aluminija; gobe za čiščenje posode in blazinice za čiščenje ali poliranje, rokavice ipd., iz aluminija; sanitarni izdelki in njihovi deli, iz aluminija',
    'Other articles of aluminium' => 'Drugi izdelki iz aluminija',
    'Unwrought lead' => 'Surovi svinec',
    'Lead plates, sheets, strip and foil; lead powders and flakes' => 'Plošče, pločevine, trakovi in folije, iz svinca; prah in luskine iz svinca',
    'Other articles of lead' => 'Drugi svinčeni izdelki',
    'Unwrought zinc' => 'Cink, surov',
    'Zinc dust, powders and flakes' => 'Cinkov prah in luskine',
