    'Magnesium and articles thereof, including waste and scrap' => 'Magnezij in magnezijevi izdelki, vključno z odpadki in ostanki',
    'Cobalt mattes and other intermediate products of cobalt metallurgy; cobalt and articles thereof, including waste and scrap' => 'Kobaltni mate in drugi vmesni izdelki metalurgije kobalta; kobalt in kobaltovi izdelki, vključno z odpadki in ostanki',
    'Bismuth and articles thereof, including waste and scrap' => 'Bizmut in bizmutovi izdelki, vključno z odpadki in ostanki',
    'Titanium and articles thereof, including waste and scrap' => 'Titan in titanovi izdelki, vključno z odpadki in ostanki',
    'Zirconium and articles thereof, including waste and scrap' => 'Cirkonij in cirkonijevi izdelki, vključno z odpadki in ostanki',
    'Antimony and articles thereof, including waste and scrap' => 'Antimon in antimonovi izdelki, vključno z odpadki in ostanki',
    'Manganese and articles thereof, including waste and scrap' => 'Mangan in manganovi izdelki, vključno z odpadki in ostanki',
    'Beryllium, chromium, hafnium, rhenium, thallium, cadmium, germanium, vanadium, gallium, indium and niobium (columbium), and articles of these metals, including waste and scrap' => 'Berilij, krom, hafnij, renij, talij, kadmij, germanij, vanadij, galij, indij in niobij (kolumbij) ter izdelki iz teh kovin, vključno z odpadki in ostanki',
    'Cermets and articles thereof, including waste and scrap' => 'Kermeti in izdelki iz kermetov; vključno z odpadki in ostanki',
    'Hand tools, the following' => 'spades, shovels, mattocks, picks, hoes, forks and rakes; axes, billhooks and similar hewing tools; secateurs and pruners of any kind; scythes, sickles, hay knives, hedge shears, timber wedges and other tools of a kind used in agriculture, horticulture or forestry\': \'Ročno orodje: rezače, lopate, krampi, kopače, motike, vile, grablje; sekire, vinjeki in podobno rezilno orodje; vrtnarske škarje in škarje za obrezovanje vej vseh vrst; kose, srpi, kline za travo, škarje za živo mejo, klini za klanje debel in drugo orodje, ki se uporablja v kmetijstvu, hortikulturi ali gozdarstvu',
    'Handsaws; blades for saws of all kinds (including slitting, slotting or toothless saw blades)' => 'Ročne žage; listi za žage vseh vrst (vključno listi za žage za vrezovanje, prerezovanje ter listi žag brez zob)',
    'Files, rasps, pliers (including cutting pliers), pincers, tweezers, metal-cutting shears, pipe-cutters, bolt croppers, perforating punches and similar hand tools' => 'Pile, rašple, klešče (vključno klešče ščipalke), pincete, škarje za rezanje kovin, sekala za cevi, sekala za svornike, luknjači in podobno ročno orodje',
    'Hand-operated spanners and wrenches (including torque meter wrenches but not including tap wrenches); interchangeable spanner sockets, with or without handles' => 'Navadni in francoski ključi za vijake, ročni (vključno z momentnimi ključi); izmenljivi vložki za ključe, z držajem ali brez njega',
    'Hand tools (including glaziers\' diamonds), not elsewhere specified or included; blowlamps; vices, clamps and the like, other than accessories for and parts of machine-tools or water-jet cutting machines; anvils; portable forges; hand- or pedal-operated grinding wheels with frameworks' => 'Ročno orodje (vključno s stekloreškimi diamanti), ki niso navedeni in ne zajeti na drugem mestu; spajkalne plamenke; primeži, vpenjala in podobno, razen dodatkov in delov za obdelovalne stroje ali stroje za rezanje z vodnim curkom; nakovala; prenosne kovačnice; brusi s stojali na ročni ali nožni pogon',
    'Interchangeable tools for hand tools, whether or not power-operated, or for machine tools (for example, for pressing, stamping, punching, tapping, threading, drilling, boring, broaching, milling, turning or screw driving), including dies for drawing or extruding metal, and rock-drilling or earth-boring tools' => 'Izmenljiva orodja za ročne obdelovalne priprave na mehanični pogon ali brez njega ali za obdelovalne stroje (npr.: za stiskanje, kovanje, vtiskovanje, prerezovanje, narezovanje ali vrezovanje navojev, vrtanje, povečevanje odprtine s struganjem, prevlačenje, rezkanje), vključno z matricami za izvlačenje ali iztiskanje kovine, in orodja za vrtanje kamna ali zemlje',
    'Knives and cutting blades, for machines or for mechanical appliances' => 'Noži in rezila, za stroje ali mehanične priprave',
    'Plates, sticks, tips and the like for tools, unmounted, of cermets' => 'Ploščice, paličice, vrhovi in podobno za orodje, nemontirani, iz sintranih kovinskih karbidov ali kermetov',
    'Knives with cutting blades, serrated or not (including pruning knives), other than knives of heading 8208, and blades therefor' => 'Noži z rezili, nazobljenimi ali nenazobljenimi (vključno z vrtnarskimi noži), razen nožev iz tarifne številke 8208 in rezil zanje',
    'Razors and razor blades (including razor blade blanks in strips)' => 'Brivski aparati, britve in rezila za britje, britvice (vključno nedokončana rezila v trakovih)',
    'Other articles of cutlery (for example, hair clippers, butchers\' or kitchen cleavers, choppers and mincing knives, paperknives); manicure or pedicure sets and instruments (including nail files)' => 'Drugi nožarski izdelki (npr. stroji za striženje, mesarske ali kuhinjske sekače, mesarske sekire in noži za sekljanje mesa, noži za papir); kompleti in priprave za manikiranje in pedikiranje (vključno pilice za nohte)',
    'Spoons, forks, ladles, skimmers, cake-servers, fish-knives, butter-knives, sugar tongs and similar kitchen or tableware' => 'Žlice, vilice, zajemalke, žlice za peno, lopatice za serviranje kolačev, noži za ribe, noži za maslo, prijemalke za sladkor in podoben kuhinjski ali namizni pribor',
    'Padlocks and locks (key, combination or electrically operated), of base metal; clasps and frames with clasps, incorporating locks, of base metal; keys for any of the foregoing articles, of base metal' => 'Žabice in ključavnice (na ključ, šifro ali električne) iz navadnih kovin; zapirala in okovje z zapirali, ki imajo vgrajene ključavnice, iz navadnih kovin; ključi katerega koli navedenih izdelkov iz navadnih kovin',
    'Base-metal mountings, fittings and similar articles suitable for furniture, doors, staircases, windows, blinds, coachwork, saddlery, trunks, chests, caskets or the like; base-metal hat-racks, hat-pegs, brackets and similar fixtures; castors with mountings of base metal; automatic door closers of base metal' => 'Okovje, pribor (fitingi) in podobni izdelki iz navadnih kovin, za pohištvo, vrata, stopnišča, okna, senčila (tudi polkna in rolete), karoserije, sedlarsko blago, kovčke, skrinje, škatle in podobno; obešalniki za klobuke, konzole ipd.; koleščki (za pohištvo ipd.), s pritrdilnimi elementi iz navadnih kovin; avtomatična zapirala za vrata, iz navadnih kovin',
    'Armoured or reinforced safes, strongboxes and doors and safe deposit lockers for strong-rooms, cash or deed boxes and the like, of base metal' => 'Armirani ali ojačani sefi, železne blagajne ter vrata in omarice oziroma predali s ključavnico za trezorje, kasete za denar ali dokumente ipd., iz navadnih kovin',
    'Fittings for loose-leaf binders or files, letter clips, letter corners, paper clips, indexing tags and similar office articles, of base metal; staples in strips (for example, for offices, upholstery, packaging), of base metal' => 'Mehanizmi za mape z nepovezanimi listi ali za fascikle, sponke za spise in pisma, kartotečni jezdeci in podobni pisarniški predmeti, iz navadnih kovin; sponke v trakovih (npr. za pisarne, tapetništvo, pakiranje) iz navadnih kovin',
    'Bells, gongs and the like, non-electric, of base metal; statuettes and other ornaments, of base metal; photograph, picture or similar frames, of base metal; mirrors of base metal' => 'Zvonci, gongi in podobno, neelektrični, iz navadnih kovin; kipci in drugi okraski iz navadnih kovin; okviri za fotografije, slike ipd. iz navadnih kovin; ogledala iz navadnih kovin',
    'Flexible tubing of base metal, with or without fittings' => 'Upogljive cevi iz navadnih kovin, s priborom ali brez njega',
    'Clasps, frames with clasps, buckles, buckle-clasps, hooks, eyes, eyelets and the like, of base metal, of a kind used for clothing or clothing accessories, footwear, jewellery, wrist watches, books, awnings, leather goods, travel goods or saddlery or for other made up articles; tubular or bifurcated rivets, of base metal; beads and spangles, of base metal' => 'Zapirala, okovje z zapirali, zaponke, zapirala z zaponkami, kaveljčki, zanke, očesca in podobno iz navadnih kovin, za obleko ali oblačilne dodatke, obutev, nakit, ročne ure, knjige, platnene strehe, usnjene izdelke, potovalne predmete ali sedlarske izdelke ali za druge gotove izdelke; cevaste ali razcepne kovice iz navadnih kovin; biseri in bleščice iz navadnih kovin',
    'Stoppers, caps and lids (including crown corks, screw caps and pouring stoppers), capsules for bottles, threaded bungs, bung covers, seals and other packing accessories, of base metal' => 'Zamaški, pokrovi, poklopci (vključno kronski zamaški, navojni zamaški in zamaški, skozi katere se izliva), tulci (kapice) za steklenice, pokrovčki iz pločevine z navojem ali brez, zalivke in drug pribor za pakiranje, iz navadnih kovin',
    'Wire, rods, tubes, plates, electrodes and similar products, of base metal or of metal carbides, coated or cored with flux material, of a kind used for soldering, brazing, welding or deposition of metal or of metal carbides; wire and rods, of agglomerated base metal powder, used for metal spraying' => 'Žice, palice, cevi, plošče, elektrode in podobni izdelki, iz navadnih kovin ali kovinskih karbidov, obloženi ali izpolnjeni s talili, ki se uporabljajo za mehko spajkanje, trdo spajkanje, varjenje ali nanašanje kovine ali kovinskega karbida; žice in palice, aglomerirane iz prahu navadnih kovin, za metalizacijo z brizganjem',
    'Nuclear reactors; fuel elements (cartridges), non-irradiated, for nuclear reactors; machinery and apparatus for isotopic separation' => 'Jedrski reaktorji; gorilni elementi (polnjenja), neobsevani, za jedrske reaktorje; stroji in aparati za separacijo izotopov',
    'Steam or other vapour generating boilers (other than central heating hot water boilers capable also of producing low pressure steam); superheated water boilers' => 'Kotli za pridobivanje vodne in druge pare (razen kotlov za centralno kurjavo s toplo vodo, ki lahko proizvajajo paro z nizkim tlakom); kotli za pregreto vodo',
    'Central heating boilers other than those of heading 8402' => 'Kotli za centralno kurjavo, razen kotlov iz tarifne številke 8402',
    'Auxiliary plant for use with boilers of heading 8402 or 8403 (for example, economisers, superheaters, soot removers, gas recoverers); condensers for steam or other vapour power units' => 'Pomožne naprave za kotle iz tarifne številke 8402 ali 8403 (npr. ekonomizerji, odstranjevalniki saj in lovilniki plina; kondenzatorji za energetske enote na vodno ali drugo paro',
    'Producer gas or water gas generators, with or without their purifiers; acetylene gas generators and similar water process gas generators, with or without their purifiers' => 'Generatorji za generatorski ali vodni plin, s svojimi čistilniki ali brez njih; acetilenski generatorji in podobni generatorji na moker postopek, s svojimi čistilniki ali brez njih',
    'Steam turbines and other vapour turbines' => 'Turbine na vodno in drugo paro',
    'Spark-ignition reciprocating or rotary internal combustion piston engines' => 'Batni motorji z notranjim zgorevanjem, na vžig s svečkami, z izmeničnim ali vrtilnim gibanjem bata',
    'Compression-ignition internal combustion piston engines (diesel or semi-diesel engines)' => 'Batni motorji z notranjim zgorevanjem, na vžig s kompresijo (dizelski ali poldizelski motorji)',
    'Parts suitable for use solely or principally with the engines of heading 8407 or 8408' => 'Deli, ki so primerni samo ali zlasti za motorje iz tarifne številke 8407 ali 8408',
    'Hydraulic turbines, water wheels, and regulators therefor' => 'Hidravlične turbine, vodna kolesa in njihovi regulatorji',
    'Turbojets, turbopropellers and other gas turbines' => 'Turboreaktivni motorji, turbopropelerski motorji in druge plinske turbine',
    'Other engines and motors' => 'Drugi pogonski stroji in motorji',
    'Pumps for liquids, whether or not fitted with a measuring device; liquid elevators' => 'Črpalke za tekočine, z merilnimi napravami ali brez njih; dvigala za tekočine',
    'Air or vacuum pumps, air or other gas compressors and fans; ventilating or recycling hoods incorporating a fan, whether or not fitted with filters; gas-tight biological safety cabinets, whether or not fitted with filters' => 'Zračne ali vakuumske črpalke, zračni ali plinski kompresorji in ventilatorji; ventilacijske ali recirkulacijske nape z vgrajenim ventilatorjem, vključno s tistimi, ki imajo filter; nepredušne biološke varnostne omarice, z vgrajenimi filtri ali brez njih',
    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Klimatske naprave z ventilatorjem na motorni pogon in elementi za spreminjanje temperature in vlažnosti, vključno s stroji, pri katerih vlažnosti ni mogoče posebej regulirati',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Gorilniki za kurišča na tekoče gorivo, na trdno gorivo v prahu ali na plin; mehanske naprave za kurjenje, vključno z njihovimi mehanskimi rešetkami, mehanskimi odstranjevalci pepela in podobnimi napravami',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Industrijske ali laboratorijske peči, vključno peči za sežiganje, neelektrične',
    'Refrigerators, freezers and other refrigerating or freezing equipment, electric or other; heat pumps other than air-conditioning machines of heading 8415' => 'Hladilniki, zamrzovalniki in druge naprave za hlajenje ali zamrzovanje, električni in drugi; toplotne črpalke, drugačne od klimatskih naprav iz tarifne številke 8415',
    'Machinery, plant or laboratory equipment, whether or not electrically heated (excluding furnaces, ovens and other equipment of heading 8514), for the treatment of materials by a process involving a change of temperature such as heating, cooking, roasting, distilling, rectifying, sterilising, pasteurising, steaming, drying, evaporating, vaporising, condensing or cooling, other than machinery or plant of a kind used for domestic purposes; instantaneous or storage water heaters, non-electric' => 'Stroji, naprave in laboratorijska oprema (vključno električno ogrevani) (brez peči in druge opreme iz tarifne številke 8514), za obdelavo materiala s spremembo temperature, kot je ogrevanje, kuhanje, žganje, destilacija, rektifikacija, sterilizacija, pasterizacija, parjenje, sušenje, izhlapevanje, vplinjevanje, kondenzacija ali hlajenje, razen gospodinjskih strojev in naprav; pretočni in akumulacijski grelniki za vodo, neelektrični',
    'Calendering or other rolling machines, other than for metals or glass, and cylinders therefor' => 'Kalandri in drugi stroji za valjanje, razen za kovine ali steklo, in valji zanje',
    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Centrifuge, vključno centrifugalni sušilniki; naprave in aparati za filtriranje in čiščenje tekočin ali plinov',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Pomivalni stroji; stroji za čiščenje ali sušenje steklenic ali drugih vsebnikov; stroji za polnjenje, zapiranje, hermetično zapiranje ali etiketiranje steklenic, pločevink, škatel, vreč ali drugih vsebnikov; stroji za kapsuliranje steklenic, kozarcev za vlaganje, cevi in podobnih vsebnikov; drugi stroji za pakiranje ali zavijanje (vključno stroji za zavijanje na osnovi toplotnega krčenja); stroji za gaziranje pijač',
    'Weighing machinery (excluding balances of a sensitivity of 5 cg or better), including weight-operated counting or checking machines; weighing machine weights of all kinds' => 'Tehtnice - tehtalne naprave (razen tehtnic z občutljivostjo do vključno 5 centigramov (0,05 g)), vključno s stroji za štetje in kontrolo, ki delujejo na podlagi tehtanja; uteži za tehtnice vseh vrst',
    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Mehanske naprave (na ročni pogon ali brez njega) za brizganje, razprševanje ali pršenje tekočin ali prahu; gasilni aparati, napolnjeni ali nenapolnjeni; brizgalne pištole in podobne naprave; stroji za brizganje pare ali peska in podobni stroji za brizganje s curkom',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Škripčevja za dviganje ali premikanje tovora, razen dvigal s prekucno transportno posodo (skipov); vitli in vretena; dvigalke',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Ladijski žerjavi; drugi žerjavi, vključno kabelski žerjavi; mobilna portalna dvigala, pajki (“straddle carriers”) in delovna vozila, opremljena z žerjavom',
    'Fork-lift trucks; other works trucks fitted with lifting or handling equipment' => 'Viličarji; druga delovna vozila z napravami za dviganje ali manipulacijo',
    'Other lifting, handling, loading or unloading machinery (for example, lifts, escalators, conveyors, teleferics)' => 'Drugi stroji za dviganje, manipulacijo, nakladanje ali razkladanje (npr. dvigala, eskalatorji, transporterji, nihajne žičnice)',
    'Self-propelled bulldozers, angledozers, graders, levellers, scrapers, mechanical shovels, excavators, shovel loaders, tamping machines and roadrollers' => 'Samovozni buldožerji, angledozerji, grejderji, ravnalniki, skreperji, bagri, nakladalniki z lopato, stroji za nabijanje in cestni valjarji, samovozni',
    'Other moving, grading, levelling, scraping, excavating, tamping, compacting, extracting or boring machinery, for earth, minerals or ores; piledrivers and pile extractors; snowploughs and snowblowers' => 'Drugi stroji za ravnanje, strganje, izkopavanje, nabijanje, kopanje ali vrtanje zemlje, mineralov ali rud; ovni in stroji za izdiranje pilotov; snežni plugi in snežni odmetalniki',
    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Deli, primerni za uporabo samo ali zlasti s stroji iz tarifnih številk 8425 do 8430',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Stroji za pripravo in kultiviranje zemlje v kmetijstvu, hortikulturi in gozdarstvu; valjarji za travnike in športne terene',
    'Harvesting or threshing machinery, including straw or fodder balers; grass or hay mowers; machines for cleaning, sorting or grading eggs, fruit or other agricultural produce, other than machinery of heading 8437' => 'Stroji za obiranje, žetev in mlatev, vključno z balarji za slamo in krmo; kosilnice za travo; stroji za čiščenje, sortiranje ali selekcijo jajc, sadja ali drugih kmetijskih pridelkov, razen strojev iz tarifne številke 8437',
    'Milking machines and dairy machinery' => 'Molzni stroji in mlekarski stroji',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Stiskalnice, sadni mlini in podobni stroji, ki se uporabljajo za pridobivanje vina, jabolčnika, sadnih sokov ali podobnih napitkov ali pijač',
    'Other agricultural, horticultural, forestry, poultry-keeping or bee-keeping machinery, including germination plant fitted with mechanical or thermal equipment; poultry incubators and brooders' => 'Drugi stroji za kmetijstvo, hortikulturo, gozdarstvo, perutninarstvo in čebelarstvo, vključno z napravami za kalitev z mehansko ali termično opremo; valilniki in tople baterije za piščance',
    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Stroji za čiščenje ali sortiranje semena, zrnja ali suhih stročnic; stroji za mlinsko industrijo ali za predelavo žit ali suhih stročnic, razen strojev za kmetijska gospodarstva',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Stroji, ki niso navedeni ali zajeti pod drugimi tarifnimi številkami tega poglavja, za industrijsko pripravljanje ali proizvodnjo hrane ali pijač, drugačni od strojev za ekstrakcijo ali pripravljanje živalskih, rastlinskih ali mikrobnih masti ali olj',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Stroji za proizvodnjo celuloze iz vlaknastih celuloznih materialov ali za proizvodnjo ali dodelavo papirjev ali kartona',
    'Bookbinding machinery, including book-sewing machines' => 'Knjigoveški stroji, vključno s stroji za šivanje knjig',
    'Other machinery for making up paper pulp, paper or paperboard, including cutting machines of all kinds' => 'Drugi stroji za predelavo papirne mase, papirja ali kartona, vključno s stroji za rezanje vseh vrst',
    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Stroji, aparati in naprave (razen strojev iz tarifnih številk 8456 do 8465) za pripravljanje ali izdelovanje plošč, valjev ali drugih tiskarskih oblik; plošče, valji ali druge tiskarske oblike; litografski kamni, plošče in valji, pripravljeni za tiskarske namene (npr. brušeni, uzrnjeni ali polirani)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Tiskarski stroji, ki se uporabljajo za tiskanje v smislu tiskanja z uporabo plošč, valjev in drugih tiskarskih komponent iz tarifne številke 8442; drugi tiskalniki, stroji za kopiranje in stroji za pošiljanje telefaksov, kombinirani ali ne; deli in pribor',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Stroji za ekstrudiranje (brizganje), izvlačenje, teksturiranje in rezanje umetnih ali sintetičnih tekstilnih filamentov',
    'Machines for preparing textile fibres; spinning, doubling or twisting machines and other machinery for producing textile yarns; textile reeling or winding (including weft-winding) machines and machines for preparing textile yarns for use on the machines of heading 8446 or 8447' => 'Stroji za pripravljanje tekstilnih vlaken; stroji za predenje, združevanje (dubliranje) ali sukanje in drugi stroji za proizvodnjo tekstilne preje; tekstilni stroji za navijanje (vključno za navijanje votka) in stroji za pripravljanje tekstilne preje za uporabo na strojih iz tarifne številke 8446 ali 8447',
    'Weaving machines (looms)' => 'Tkalski stroji (statve)',
    'Knitting machines, stitch-bonding machines and machines for making gimped yarn, tulle, lace, embroidery, trimmings, braid or net and machines for tufting' => 'Pletilni stroji, šivalni prepletilniki in stroji za proizvodnjo ovite preje, tila, čipk, vezenin, pozamenterije, pletenic ali mrež, in tafting stroji',
    'Auxiliary machinery for use with machines of heading 8444, 8445, 8446 or 8447 (for example, dobbies, jacquards, automatic stop motions, shuttle changing mechanisms); parts and accessories suitable for use solely or principally with the machines of this heading or of heading 8444, 8445, 8446 or 8447 (for example, spindles and spindle flyers, card clothing, combs, extruding nipples, shuttles, healds and heald-frames, hosiery needles)' => 'Pomožni stroji za uporabo s stroji iz tarifne številke 8444, 8445, 8446 ali 8447 (npr. nitni stroji, žakarski stroji, avtomatske naprave za ustavljanje in mehanizmi za spreminjane smeri čolničkov); deli in pribor, ki so primerni za uporabo samo ali zlasti s stroji iz te tarifne številke ali iz tarifne številke 8444, 8445, 8446 ali 8447 (npr. vretena in krila za vretena, garniture za mikalnike, glavniki, ekstruzijske šobe, čolnički, nicalnice, listi za nicalnice in igle)',
    'Household or laundry-type washing machines, including machines which both wash and dry' => 'Pralni stroji, za gospodinjstva in pralnice, vključno s stroji, ki perejo in sušijo',
    'Machinery (other than machines of heading 8450) for washing, cleaning, wringing, drying, ironing, pressing (including fusing presses), bleaching, dyeing, dressing, finishing, coating or impregnating textile yarns, fabrics or made-up textile articles and machines for applying the paste to the base fabric or other support used in the manufacture of floor coverings such as linoleum; machines for reeling, unreeling, folding, cutting or pinking textile fabrics' => 'Stroji (razen strojev iz tarifne številke 8450) za pranje, čiščenje, ožemanje (perila), sušenje, likanje (vključno s stiskalnicami za fiksiranje), beljenje, barvanje, apretiranje, dovrševanje, prevlačenje ali impregniranje tekstilnih prej, materialov ali gotovih tekstilnih izdelkov in stroji za nanašanje paste na osnovni material ali drugo podlago, ki se uporablja pri proizvodnji talnih oblog, kot je linolej; stroji za navijanje, odvijanje, zlaganje, rezanje ali zobčasto izrezovanje tekstilnih materialov',
    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Šivalni stroji, razen strojev za šivanje knjig iz tarifne številke 8440; omarice, stojala in pokrovi, posebej zasnovani za šivalne stroje; igle za šivalne stroje',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Stroji za pripravljanje, strojenje in obdelavo surovih ali strojenih kož (z dlako ali brez nje), proizvodnjo ali popravilo obutve ali drugih predmetov iz surovih ali strojenih kož (z dlako ali brez nje), razen šivalnih strojev',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Konvertorji, livarski lonci, forme za ingote in livarski stroji, ki se uporabljajo v metalurgiji ali livarnah kovin',
    'Metal-rolling mills and rolls therefor' => 'Valjarniška ogrodja in proge, za kovine; valji za valjarniška ogrodja in proge',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Obdelovalni stroji za obdelavo materialov vseh vrst z odvzemanjem materiala z laserjem ali drugim svetlobnim ali fotonskim snopom, ultrazvokom, elektroerozijo, elektrokemičnim postopkom, elektronskim snopom, ionskim snopom ali snopom plazme; stroji za rezanje z vodnim curkom',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Centri za strojno obdelavo, stroji, izdelani po principu standardnih enot (z eno postajo) in prenašalni stroji z več postajami, za obdelavo kovin',
    'Lathes (including turning centres) for removing metal' => 'Stružnice (vključno stružni centri) za odstranjevanje kovin',
    'Machine tools (including way-type unit head machines) for drilling, boring, milling, threading or tapping by removing metal, other than lathes (including turning centres) of heading 8458' => 'Obdelovalni stroji za obdelavo kovin z odvzemanjem materiala (vključno stroji z delovnimi enotami na vodilih), z vrtanjem, povečevanjem odprtin (s struženjem ali rezkanjem), z rezkanjem, vrezovanjem ali narezovanjem navojev, razen stružnic iz tarifne številke 8458',
    'Machine tools for deburring, sharpening, grinding, honing, lapping, polishing or otherwise finishing metal or cermets by means of grinding stones, abrasives or polishing products, other than gear cutting, gear grinding or gear finishing machines of heading 8461' => 'Obdelovalni stroji za raziglanje, ostrenje, brušenje, honanje, lepanje, poliranje ali drugačno dodelavo kovin, sintranih kovinskih karbidov ali kermetov z brusi, abrazivi, ali z izdelki za poliranje, razen strojev za izdelavo zobnikov z rezanjem, brušenjem ali dodelavo zobnikov iz tarifne številke 8461',
    'Machine tools for planing, shaping, slotting, broaching, gear cutting, gear grinding or gear finishing, sawing, cutting-off and other machine tools working by removing metal or cermets, not elsewhere specified or included' => 'Obdelovalni stroji za obdelavo kovin, sintranih kovinskih karbidov ali kermetov z odvzemanjem materiala: s skobljanjem, z izdelavo utorov, vlečenjem, rezanjem zobnikov, brušenjem zobnikov ali dodelavo zobnikov, z žaganjem, z odrezovanjem in drugimi postopki, ki niso navedeni ali zajeti na drugem mestu',
    'Machine tools (including presses) for working metal by forging, hammering or die forging (excluding rolling mills); machine tools (including presses, slitting lines and cut-to-length lines) for working metal by bending, folding, straightening, flattening, shearing, punching, notching or nibbling (excluding draw-benches); presses for working metal or metal carbides, not specified above' => 'Obdelovalni stroji (vključno s stiskalnicami) za obdelavo kovin s prostim kovanjem, tolčenjem ali utopnim kovanjem (razen valjarniških ogrodij); obdelovalni stroji (vključno s stiskalnicami, linijami za dolžinski razrez in linijami za prečni razrez) za obdelavo kovin z upogibanjem, prepogibanjem, ravnanjem, poravnavanjem, striženjem, luknjanjem, zarezovanjem ali izsekovanjem (razen strojev za vlečenje); stiskalnice za obdelavo kovin ali kovinskih karbidov, ki niso zgoraj navedene',
    'Other machine tools for working metal or cermets, without removing material' => 'Drugi stroji za obdelavo kovin, sintranih kovinskih karbidov ali kermetov, brez odvzemanja materiala',
    'Machine tools for working stone, ceramics, concrete, asbestos-cement or like mineral materials or for cold working glass' => 'Stroji za obdelavo kamna, keramike, betona, azbesta, cementa in podobnih mineralnih materialov ali za hladno obdelavo stekla',
    'Machine tools (including machines for nailing, stapling, glueing or otherwise assembling) for working wood, cork, bone, hard rubber, hard plastics or similar hard materials' => 'Stroji (vključno s stroji za povezovanje z žeblji, žičnimi sponkami, lepljenjem ali drug način sestavljanja) za obdelavo lesa, plute, kosti, trde gume, trde plastike ali podobnih trdih materialov',
    'Parts and accessories suitable for use solely or principally with the machines of headings 8456 to 8465, including work or tool holders, self-opening dieheads, dividing heads and other special attachments for the machines; tool holders for any type of tool for working in the hand' => 'Deli in pribor, uporabni samo ali zlasti s stroji iz tarifnih številk 8456 do 8465, vključno z držali za obdelovance in orodje, samoodpiralnimi glavami za rezanje navojev, razdelilnimi glavami in drugimi specialnimi dodatnimi napravami za stroje; držala za katero koli vrsto orodja, ki se pri delu držijo v roki',
    'Tools for working in the hand, pneumatic, hydraulic or with self-contained electric or non-electric motor' => 'Ročno orodje, pnevmatsko, hidravlično, ali z vdelanim električnim ali neelektričnim motorjem',
    'Machinery and apparatus for soldering, brazing or welding, whether or not capable of cutting, other than those of heading 8515; gas-operated surface tempering machines and appliances' => 'Stroji in aparati za spajkanje in varjenje, vključno s stroji, ki lahko režejo, razen strojev iz tarifne številke 8515; stroji in aparati na plin za površinsko kaljenje',
    'Calculating machines and pocket-size data-recording, reproducing and displaying machines with calculating functions; accounting machines, postage-franking machines, ticket-issuing machines and similar machines, incorporating a calculating device; cash registers' => 'Računski stroji in stroji za snemanje, reprodukcijo in prikazovanje podatkov z računskimi funkcijami žepne velikosti; knjigovodski stroji, frankirni stroji, stroji za izdajanje kart in podobni stroji z vdelanimi računskimi napravami; registrirne blagajne',
    'Automatic data-processing machines and units thereof; magnetic or optical readers, machines for transcribing data onto data media in coded form and machines for processing such data, not elsewhere specified or included' => 'Računalniki - stroji za avtomatsko obdelavo podatkov in njihove enote; magnetni ali optični čitalniki, stroji za prepisovanje podatkov na nosilce podatkov v kodirani obliki in stroji za obdelavo takih podatkov, ki niso navedeni ali zajeti na drugem mestu',
    'Other office machines (for example, hectograph or stencil duplicating machines, addressing machines, automatic banknote dispensers, coin-sorting machines, coin-counting or -wrapping machines, pencil-sharpening machines, perforating or stapling machines)' => 'Drugi pisarniški stroji (npr. razmnoževalni stroji – hektografski ali na matrice, stroji za naslavljanje, avtomatski stroji za izplačilo bankovcev, stroji za sortiranje, štetje ali pakiranje kovancev, stroji za šiljenje svinčnikov, stroji za perforiranje ali spajanje z žičnimi sponkami)',
    'Parts and accessories (other than covers, carrying cases and the like) suitable for use solely or principally with machines of headings 8470 to 8472' => 'Deli in pribor (razen pokrovov, kovčkov za stroje ipd.), ki so samo ali zlasti primerni za uporabo s stroji iz tarifnih številk 8470 do 8472',
    'Machinery for sorting, screening, separating, washing, crushing, grinding, mixing or kneading earth, stone, ores or other mineral substances, in solid (including powder or paste) form; machinery for agglomerating, shaping or moulding solid mineral fuels, ceramic paste, unhardened cements, plastering materials or other mineral products in powder or paste form; machines for forming foundry moulds of sand' => 'Stroji za sortiranje, sejanje, separacijo, pranje, drobljenje, mletje, mešanje ali gnetenje zemlje, kamna, rudnin ali drugih trdnih mineralnih materialov (vključno s prahom ali pasto); stroji za aglomeriranje, modeliranje ali oblikovanje trdnih mineralnih goriv, keramične mase, cementa, sadre ali drugih mineralnih izdelkov v obliki prahu ali paste; stroji za izdelavo peščenih livarskih kalupov',
    'Machines for assembling electric or electronic lamps, tubes or valves or flashbulbs, in glass envelopes; machines for manufacturing or hot working glass or glassware' => 'Stroji za montiranje električnih ali elektronskih žarnic, sijalk ali elektronk ali bliskovnih žarnic v steklene plašče; stroji za proizvodnjo ali vročo obdelavo stekla in steklenih izdelkov',
    'Automatic goods-vending machines (for example, postage stamp, cigarette, food or beverage machines), including money-changing machines' => 'Avtomatski stroji za prodajo blaga (npr. stroji za poštne znamke, cigarete, hrano ali napitke), vključno s stroji za menjanje denarja za drobiž',
    'Machinery for working rubber or plastics or for the manufacture of products from these materials, not specified or included elsewhere in this chapter' => 'Stroji za obdelavo gume ali plastične mase ali za izdelavo izdelkov iz teh materialov, ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Machinery for preparing or making up tobacco, not specified or included elsewhere in this chapter' => 'Stroji za pripravo ali predelavo tobaka, ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Machines and mechanical appliances having individual functions, not specified or included elsewhere in this chapter' => 'Stroji in mehanske naprave s posebnimi funkcijami, ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Moulding boxes for metal foundry; mould bases; moulding patterns; moulds for metal (other than ingot moulds), metal carbides, glass, mineral materials, rubber or plastics' => 'Livarski okvirji za livarne kovin; modelne plošče; modeli za kalupe, kalupi za kovino (razen kalupov za ingote), kovinske karbide, steklo, mineralne materiale, gumo in plastične mase',
    'Taps, cocks, valves and similar appliances for pipes, boiler shells, tanks, vats or the like, including pressure-reducing valves and thermostatically controlled valves' => 'Pipe, ventili in podobne naprave za cevovode, kotle, rezervoarje, velike posode in podobno, vključno z redukcijskimi ventili in termostatsko krmiljenimi ventili',
    'Ball or roller bearings' => 'Kotalni ležaji',
    'Transmission shafts (including cam shafts and crank shafts) and cranks; bearing housings and plain shaft bearings; gears and gearing; ball or roller screws; gear boxes and other speed changers, including torque converters; flywheels and pulleys, including pulley blocks; clutches and shaft couplings (including universal joints)' => 'Transmisijske gredi (vključno odmične gredi in kolenaste gredi) in ročice; ohišja za ležaje in drsni ležaji; zobniki, zobniški in frikcijski prenosniki; navojna vretena s kroglicami ali valji; menjalniki in drugi prenosi hitrosti, vključno pretvorniki navora; vztrajniki, jermenice in vrvenice (vključno s tistimi za škripčevja); sklopke in gredne vezi (vključno križni in kardanski zglobi)',
    'Gaskets and similar joints of metal sheeting combined with other material or of two or more layers of metal; sets or assortments of gaskets and similar joints, dissimilar in composition, put up in pouches, envelopes or similar packings; mechanical seals' => 'Tesnila iz kovinskih listov, kombinirana z drugim materialom, ali iz dveh ali več plasti kovine; garniture tesnil, različne po sestavi materiala, v vrečkah, ovitkih ali podobnih pakiranjih; mehanska tesnila',
    'Machines for additive manufacturing' => 'Stroji za aditivno proizvodnjo (3D tiskalniki)',
    'Machines and apparatus of a kind used solely or principally for the manufacture of semiconductor boules or wafers, semiconductor devices, electronic integrated circuits or flat panel displays; machines and apparatus specified in note 11(C) to this chapter; parts and accessories' => 'Stroji in aparati, ki se uporabljajo samo ali zlasti za izdelavo polprevodniških ingotov, rezin, polprevodniških naprav, elektronskih integriranih vezij ali ploskih ravnih prikazovalnikov; stroji in aparati opredeljeni v opombi 11(C) tega poglavja; deli in pribor',
    'Machinery parts, not containing electrical connectors, insulators, coils, contacts or other electrical features, not specified or included elsewhere in this chapter' => 'Deli strojev brez električnih priključkov, izolatorjev, tuljav, kontaktov ali drugih električnih delov, ki niso navedeni in ne zajeti na drugem mestu v tem poglavju',
    'Electric motors and generators (excluding generating sets)' => 'Elektromotorji in električni generatorji (razen generatorskih agregatov)',
    'Electric generating sets and rotary converters' => 'Električni generatorski agregati in rotacijski pretvorniki',
    'Parts suitable for use solely or principally with the machines of heading 8501 or 8502' => 'Deli, ki so samo ali zlasti primerni za uporabo s stroji iz tarifne številke 8501 ali 8502',
    'Electrical transformers, static converters (for example, rectifiers) and inductors' => 'Električni transformatorji, statični pretvorniki (npr. usmerniki) in indukcijske tuljave',
    'Electromagnets; permanent magnets and articles intended to become permanent magnets after magnetisation; electromagnetic or permanent magnet chucks, clamps and similar holding devices; electromagnetic couplings, clutches and brakes; electromagnetic lifting heads' => 'Elektromagneti; trajni magneti in izdelki, ki so namenjeni, da po magnetenju postanejo trajni magneti; vpenjalne glave, vpenjalne naprave in podobna držala za obdelovance na osnovi elektromagnetov ali trajnih magnetov; elektromagnetne sklopke in zavore; elektromagnetne dvigalne glave',
    'Primary cells and primary batteries' => 'Primarne celice in primarne baterije',
    'Electric accumulators, including separators therefor, whether or not rectangular (including square)' => 'Električni akumulatorji, vključno s separatorji zanje, pravokotni ali ne, vključno s kvadratnimi',
    'Vacuum cleaners' => 'Sesalniki za prah',
    'Electromechanical domestic appliances, with self-contained electric motor, other than vacuum cleaners of heading 8508' => 'Elektromehanski gospodinjski aparati z vdelanim elektromotorjem, razen sesalnikov za prah iz tarifne številke 8508',
    'Shavers, hair clippers and hair-removing appliances, with self-contained electric motor' => 'Aparati za britje, striženje ter naprave za odstranjevanje dlak z vdelanim elektromotorjem',
    'Electrical ignition or starting equipment of a kind used for spark-ignition or compression-ignition internal combustion engines (for example, ignition magnetos, magneto-dynamos, ignition coils, sparking plugs and glow plugs, starter motors); generators (for example, dynamos, alternators) and cut-outs of a kind used in conjunction with such engines' => 'Električna oprema za vžiganje in zaganjanje motorjev z notranjim zgorevanjem, ki se vžigajo s svečko ali kompresijo (npr. vžigalni magneti, magnetna dinama, vžigalne tuljave, vžigalne svečke, ogrevalne svečke, električni zaganjalniki); generatorji (npr. dinama in alternatorji) in regulatorji zanje',
    'Electrical lighting or signalling equipment (excluding articles of heading 8539), windscreen wipers, defrosters and demisters, of a kind used for cycles or motor vehicles' => 'Električna oprema za razsvetljavo in signalizacijo (razen izdelkov iz tarifne številke 8539), vetrobranski brisalci, naprave za odmrznitev in naprave za razmeglitev, za dvokolesa in motorna vozila',
    'Portable electric lamps designed to function by their own source of energy (for example, dry batteries, accumulators, magnetos), other than lighting equipment of heading 8512' => 'Prenosne električne svetilke z lastnim virom energije (npr. suhe baterije, akumulatorji ali elektromagneti), razen opreme za razsvetljavo iz tarifne številke 8512',
    'Industrial or laboratory electric furnaces and ovens (including those functioning by induction or dielectric loss); other industrial or laboratory equipment for the heat treatment of materials by induction or dielectric loss' => 'Industrijske ali laboratorijske električne peči (vključno s tistimi, ki delujejo na principu indukcije ali dielektrične izgube); druga oprema za segrevanje materialov na principu indukcije ali dielektrične izgube',
    'Electric (including electrically heated gas), laser or other light or photon beam, ultrasonic, electron beam, magnetic pulse or plasma arc soldering, brazing or welding machines and apparatus, whether or not capable of cutting; electric machines and apparatus for hot spraying of metals or cermets' => 'Stroji in aparati za mehko in trdo spajkanje ali varjenje, električni (vključno z električno segrevalnim plinom), laserski ali na principu druge svetlobe ali fotonskega snopa, ultrazvoka, elektronskega snopa, magnetnih impulzov ali plazemskega obloka, vključno s tistimi, s katerimi se lahko reže; električni stroji in aparati za vroče brizganje kovin ali kermetov',
    'Electric instantaneous or storage water heaters and immersion heaters; electric space-heating apparatus and soil-heating apparatus; electrothermic hairdressing apparatus (for example, hairdryers, hair curlers, curling tong heaters) and hand dryers; electric smoothing irons; other electrothermic appliances of a kind used for domestic purposes; electric heating resistors, other than those of heading 8545' => 'Električni pretočni ali akumulacijski grelniki vode in potopni grelniki; električni aparati za ogrevanje prostorov in električne naprave za ogrevanje tal; elektrotermični aparati za urejanje las (npr. aparati za sušenje las, aparati za kodranje las idr.) in aparati za sušenje rok; električni likalniki; druge gospodinjske elektrotermične naprave; električni grelni upori, razen tistih iz tarifne številke 8545',
    'Telephone sets, including smartphones and other telephones for cellular networks or for other wireless networks; other apparatus for the transmission or reception of voice, images or other data, including apparatus for communication in a wired or wireless network (such as a local or wide area network), other than transmission or reception apparatus of heading 8443, 8525, 8527 or 8528' => 'Telefonski aparati za žično telefonijo, vključno pametni telefoni in drugi telefonski aparati za mobilno telefonijo in druga brezžična omrežja; drugi aparati za prenos ali sprejem glasu, slike ali drugih podatkov, vključno aparati za komunikacijo v žičnem ali brezžičnem omrežju (kot npr. lokalno ali prostrano omrežje), razen sprejemnikov in oddajnikov iz tarifnih številk 8443, 8525, 8527 ali 8528',
    'Microphones and stands therefor; loudspeakers, whether or not mounted in their enclosures; headphones and earphones, whether or not combined with a microphone, and sets consisting of a microphone and one or more loudspeakers; audio-frequency electric amplifiers; electric sound amplifier sets' => 'Mikrofoni in njihova stojala; zvočniki, vključno z zvočniki v zvočnih ohišjih; naglavne slušalke in ušesne slušalke, kombinirane z mikrofonom ali ne, in kompleti, ki sestojijo iz mikrofona in enega ali več zvočnikov; avdiofrekvenčni električni ojačevalniki; električni sestavi za ojačevanje zvoka',
    'Sound recording or sound reproducing apparatus' => 'Aparati za snemanje ali reprodukcijo zvoka',
    'Video recording or reproducing apparatus, whether or not incorporating a video tuner' => 'Aparati za snemanje ali reprodukcijo slike, ki imajo vgrajen videotuner (TV – sprejemno enoto) ali ne',
    'Parts and accessories suitable for use solely or principally with the apparatus of heading 8519 or 8521' => 'Deli in pribor, uporabni samo ali zlasti z aparati iz tarifnih številk 8519 ali 8521',
    'Discs, tapes, solid-state non-volatile storage devices, smart cards and other media for the recording of sound or of other phenomena, whether or not recorded, including matrices and masters for the production of discs, but excluding products of Chapter 37' => 'Plošče (diski), trakovi, polprevodniški nosilci s trajnim pomnenjem, pametne kartice in drugi nosilci za snemanje zvočnih ali drugih pojavov, posneti ali ne, vključno z matricami in galvanskimi odtisi za proizvodnjo plošč, razen izdelkov iz poglavja 37',
    'Flat panel display modules, whether or not incorporating touch-sensitive screens' => 'Moduli z ravnimi ploskimi prikazovalniki, z zasloni na dotik ali brez njih',
    'Transmission apparatus for radio-broadcasting or television, whether or not incorporating reception apparatus or sound recording or reproducing apparatus; television cameras, digital cameras and video camera recorders' => 'Oddajniki za radiodifuzijo ali televizijo, z vgrajenim sprejemnikom ali aparatom za snemanje ali reprodukcijo zvoka ali ne; televizijske kamere, digitalni fotoaparati in video snemalne kamere',
    'Radar apparatus, radio navigational aid apparatus and radio remote control apparatus' => 'Radarji, naprave za radionavigacijo in aparati za radijsko daljinsko krmiljenje',
    'Reception apparatus for radio-broadcasting, whether or not combined, in the same housing, with sound recording or reproducing apparatus or a clock' => 'Sprejemniki za radiodifuzijo, kombinirani ali ne v istem ohišju z aparatom za snemanje ali reprodukcijo zvoka ali z uro',
    'Monitors and projectors, not incorporating television reception apparatus; reception apparatus for television, whether or not incorporating radio-broadcast receivers or sound or video recording or reproducing apparatus' => 'Monitorji in projektorji, ki nimajo vgrajenega televizijskega sprejemnika; televizijski sprejemniki, kombinirani ali nekombinirani v istem ohišju z radijskimi sprejemniki ali aparati za snemanje ali reprodukcijo zvoka ali slike',
    'Parts suitable for use solely or principally with the apparatus of headings 8524 to 8528' => 'Deli, ki so samo ali zlasti namenjeni za uporabo z aparati iz tarifnih številk 8524 do 8528',
    'Electrical signalling, safety or traffic control equipment for railways, tramways, roads, inland waterways, parking facilities, port installations or airfields (other than those of heading 8608)' => 'Električna oprema za signalizacijo, varnost, nadzor ali upravljanje prometa po železniških ali tramvajskih progah, cestah, notranjih vodnih poteh, parkiriščih, lukah ali letališčih (razen opreme iz tarifne številke 8608)',
    'Electric sound or visual signalling apparatus (for example, bells, sirens, indicator panels, burglar or fire alarms), other than those of heading 8512 or 8530' => 'Električni aparati za zvočno ali vizualno signalizacijo (npr. zvonci, sirene, indikatorske plošče, alarmni aparati proti tatvini ali požaru), razen tistih iz tarifnih številk 8512 ali 8530',
    'Electrical capacitors, fixed, variable or adjustable (pre-set)' => 'Električni kondenzatorji, konstantni, spremenljivi ali nastavljivi (vnaprej nastavljeni)',
    'Electrical resistors (including rheostats and potentiometers), other than heating resistors' => 'Električni upori (vključno z reostati in potenciometri), razen grelnih uporov',
    'Printed circuits' => 'Tiskana vezja',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, fuses, lightning arresters, voltage limiters, surge suppressors, plugs and other connectors, junction boxes), for a voltage exceeding 1000 V' => 'Električni aparati za vklapljanje, izklapljanje ali zaščito električnih tokokrogov ali za povezavo z električnimi tokokrogi ali znotraj njih (npr. stikala, varovalke, prenapetostni odvodniki, omejevalniki napetosti, dušilni elementi motečih valov, vtiči in drugi konektorji, priključno - razdelilne omare), za napetost nad 1000 V',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, relays, fuses, surge suppressors, plugs, sockets, lamp holders and other connectors, junction boxes), for a voltage not exceeding 1000 V; connectors for optical fibres, optical fibre bundles or cables' => 'Električni aparati za vklapljanje in izklapljanje, ali za zaščito električnih tokokrogov, ali za povezavo z električnimi tokokrogi ali znotraj njih (npr. stikala, releji, varovalke, dušilni elementi motečih valov, vtiči in vtičnice, okovi žarnic in drugi konektorji, priključno-razdelilne omare), za napetosti do vključno 1000 V; konektorji za optična vlakna, snope optičnih vlaken ali kable iz optičnih vlaken',
    'Boards, panels, consoles, desks, cabinets and other bases, equipped with two or more apparatus of heading 8535 or 8536, for electric control or the distribution of electricity, including those incorporating instruments or apparatus of Chapter 90, and numerical control apparatus, other than switching apparatus of heading 8517' => 'Table, plošče, pulti, mize, omare in druge osnove, opremljene z dvema ali več izdelki iz tarifne številke 8535 ali 8536, za električno krmiljenje ali razdeljevanje električnega toka, vključno s tistimi z vgrajenimi instrumenti in aparati iz poglavja 90 in aparati za numerično krmiljenje, razen telefonskih central iz tarifne številke 8517',
    'Parts suitable for use solely or principally with the apparatus of heading 8535, 8536 or 8537' => 'Deli, ki so samo ali zlasti namenjeni za uporabo z aparati iz tarifne številke 8535, 8536 ali 8537',
    'Electric filament or discharge lamps, including sealed beam lamp units and ultraviolet or infra-red lamps; arc-lamps; light-emitting diode (LED) light sources' => 'Električne žarnice z nitko in sijalke na razelektrenje, vključno zaprte reflektorske luči s prednjo lečo, ultravijolične in infrardeče sijalke; obločnice; svetlobni viri s svetlečimi diodami (LED)',
    'Thermionic, cold cathode or photocathode valves and tubes (for example, vacuum or vapour or gas filled valves and tubes, mercury arc rectifying valves and tubes, cathode ray tubes, television camera tubes)' => 'Žarilnokatodne, hladnokatodne in fotokatodne elektronke in cevi (npr. vakuumske elektronke ali cevi, napolnjene s paro ali plinom, živosrebrove usmerjevalke, katodne cevi, slikovne cevi za televizijske kamere)',
    'Semiconductor devices (for example, diodes, transistors, semiconductor-based transducers); photosensitive semiconductor devices, including photovoltaic cells whether or not assembled in modules or made up into panels; light-emitting diodes (LED), whether or not assembled with other light-emitting diodes (LED); mounted piezo-electric crystals' => 'Polprevodniški elementi (npr. diode, tranzistorji, polprevodniški pretvorniki); fotoobčutljivi polprevodniški elementi, vključno fotonapetostne celice, sestavljene v module ali plošče ali ne; svetleče diode (LED), sestavljene z drugimi svetlečimi diodami (LED) ali ne; montirani piezoelektrični kristali',
    'Electronic integrated circuits' => 'Elektronska integrirana vezja',
    'Electrical machines and apparatus, having individual functions, not specified or included elsewhere in this chapter' => 'Električni stroji in aparati s posebnimi funkcijami, ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Insulated (including enamelled or anodised) wire, cable (including coaxial cable) and other insulated electric conductors, whether or not fitted with connectors; optical fibre cables, made up of individually sheathed fibres, whether or not assembled with electric conductors or fitted with connectors' => 'Izolirana žica (vključno z lakirano žico ali elektrolitsko oksidirano žico), kabli (vključno s koaksialnimi kabli) in drugi izolirani električni vodniki, s konektorjem ali brez njega; kabli iz optičnih vlaken, izdelani iz posamično oplaščenih vlaken, kombinirani z električnimi vodniki ali ne, s konektorjem ali brez njega',
    'Carbon electrodes, carbon brushes, lamp carbons, battery carbons and other articles of graphite or other carbon, with or without metal, of a kind used for electrical purposes' => 'Ogljene elektrode, ogljene ščetke, oglje za žarnice, oglje za baterije in drugi izdelki iz grafita ali drugega oglja, s kovino ali brez nje, za električne namene',
    'Electrical insulators of any material' => 'Električni izolatorji iz kakršnega koli materiala',
    'Insulating fittings for electrical machines, appliances or equipment, being fittings wholly of insulating material apart from any minor components of metal (for example, threaded sockets) incorporated during moulding solely for purposes of assembly, other than insulators of heading 8546; electrical conduit tubing and joints therefor, of base metal lined with insulating material' => 'Izolirni deli za električne stroje, naprave ali opremo, izdelani v celoti iz izolirnega materiala ali samo z manjšimi kovinskimi komponentami (npr. tulci z navojem), vdelanimi med stiskanjem izključno zaradi vezave, razen izolatorjev iz tarifne številke 8546; cevi za električne vodnike in spojke zanje, iz navadnih kovin, obložene z izolirnim materialom',
    'Electrical parts of machinery or apparatus, not specified or included elsewhere in this chapter' => 'Električni deli strojev ali aparatov, ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Electrical and electronic waste and scrap' => 'Električni in elektronski odpadki in ostanki',
    'Rail locomotives powered from an external source of electricity or by electric accumulators' => 'Tirne lokomotive, napajane iz zunanjega vira električne energije ali iz električnega akumulatorja',
    'Other rail locomotives; locomotive tenders' => 'Druge tirne lokomotive; zalogovnik lokomotive',
    'Self-propelled railway or tramway coaches, vans and trucks, other than those of heading 8604' => 'Samovozni železniški in tramvajski potniški in tovorni vagoni, razen tistih iz tarifne številke 8604',
    'Railway or tramway goods vans and wagons, not self-propelled' => 'Železniški ali tramvajski tovorni vagoni, nesamovozni',
    'Parts of railway or tramway locomotives or rolling stock' => 'Deli železniških ali tramvajskih lokomotiv ali tirnih vozil',
    'Containers (including containers for the transport of fluids) specially designed and equipped for carriage by one or more modes of transport' => 'Zabojniki (vključno z zabojniki za transport tekočin), specialno konstruirani in opremljeni za enega ali več načinov prevoza',
    'Tractors (other than tractors of heading 8709)' => 'Traktorji (razen traktorjev iz tarifne številke 8709)',
    'Motor vehicles for the transport of ten or more persons, including the driver' => 'Motorna vozila za prevoz 10 ali več oseb, vključno z voznikom',
    'Motor cars and other motor vehicles principally designed for the transport of persons (other than those of heading 8702), including station wagons and racing cars' => 'Osebni avtomobili in druga motorna vozila, konstruirana predvsem za prevoz oseb (razen vozil iz tarifne številke 8702), vključno motorna vozila tipa “karavan” in dirkalni avtomobili',
    'Motor vehicles for the transport of goods' => 'Motorna vozila za prevoz blaga',
    'Special purpose motor vehicles, other than those principally designed for the transport of persons or goods (for example, breakdown lorries, crane lorries, fire fighting vehicles, concrete-mixer lorries, road sweeper lorries, spraying lorries, mobile workshops, mobile radiological units)' => 'Motorna vozila za posebne namene (npr. samonakladalna vozila za prevoz vozil z okvarami, vozila z dvigali, gasilska vozila, vozila z vgrajenimi betonskimi mešalniki, vozila za čiščenje cest, vozila za škropljenje ali posipavanje, mobilne delavnice, mobilne radiološke enote), razen motornih vozil, ki so konstruirana predvsem za prevoz oseb ali blaga',
    'Chassis fitted with engines, for the motor vehicles of headings 8701 to 8705' => 'Šasije z vgrajenimi motorji, za motorna vozila iz tarifnih številk 8701 do 8705',
    'Bodies (including cabs), for the motor vehicles of headings 8701 to 8705' => 'Karoserije (vključno kabine) za motorna vozila iz tarifnih številk 8701 do 8705',
    'Parts and accessories of the motor vehicles of headings 8701 to 8705' => 'Deli in pribor za motorna vozila iz tarifnih številk 8701 do 8705',
    'Works trucks, self-propelled, not fitted with lifting or handling equipment, of the type used in factories, warehouses, dock areas or airports for short distance transport of goods; tractors of the type used on railway station platforms; parts of the foregoing vehicles' => 'Samovozna delovna vozila, brez naprav za dviganje ali manipuliranje, ki se uporabljajo v tovarnah, skladiščih, lukah ali na letališčih za prevoz blaga na kratkih razdaljah; vlečna vozila, ki se uporabljajo na peronih železniških postaj; deli navedenih vozil',
    'Motorcycles (including mopeds) and cycles fitted with an auxiliary motor, with or without side-cars; side-cars' => 'Motorna kolesa (tudi mopedi), kolesa in podobna vozila s pomožnim motorjem, z bočno prikolico ali brez nje; bočne prikolice',
    'Bicycles and other cycles (including delivery tricycles), not motorised' => 'Dvokolesa in druga podobna kolesa (tudi dostavni tricikli), brez motornega pogona',
    'Carriages for disabled persons, whether or not motorised or otherwise mechanically propelled' => 'Vozički za invalidne osebe, z motornim ali drugačnim mehanskim pogonom ali brez takega pogona',
    'Parts and accessories of vehicles of headings 8711 to 8713' => 'Deli in pribor vozil iz tarifnih številk 8711 do 8713',
    'Baby carriages and parts thereof' => 'Otroški vozički in njihovi deli',
    'Trailers and semi-trailers; other vehicles, not mechanically propelled; parts thereof' => 'Priklopniki in polpriklopniki; druga vozila brez lastnega pogona; njihovi deli',
    'Balloons and dirigibles; gliders, hang gliders and other non-powered aircraft' => 'Baloni in vodljivi zrakoplovi; jadralna letala, pilotirani zmaji in drugi zrakoplovi brez pogona',
    'Other aircraft (for example, helicopters, aeroplanes), except unmanned aircraft of heading 8806; spacecraft (including satellites) and suborbital and spacecraft launch vehicles' => 'Drugi zrakoplovi (npr. helikopterji, letala), razen dronov iz tar. št. 8806; vesoljska vozila (vključno s sateliti) in sredstva za orbitalno ali izvenorbitalno lansiranje vesoljskih vozil',
    'Aircraft launching gear; deck-arrestor or similar gear; ground flying trainers; parts of the foregoing articles' => 'Oprema za lansiranje letal; krovna prestrezala letal in podobne naprave; naprave za treniranje letenja na tleh; deli navedenih izdelkov',
    'Unmanned aircraft' => 'Droni',
    'Parts of goods of heading 8801, 8802 or 8806' => 'Deli izdelkov iz tarifne številke 8801, 8802 ali 8806',
    'Cruise ships, excursion boats, ferry-boats, cargo ships, barges and similar vessels for the transport of persons or goods' => 'Potniške ladje, izletniške ladje, trajekti, tovorne ladje, barže in podobna plovila za prevoz oseb in blaga',
    'Fishing vessels; factory ships and other vessels for processing or preserving fishery products' => 'Ribiška plovila; ladje-tovarne in druga plovila za predelavo in konserviranje ribjih izdelkov',
    'Yachts and other vessels for pleasure or sports; rowing boats and canoes' => 'Jahte in druga plovila za šport ali razvedrilo; čolni na vesla in kanuji',
    'Tugs and pusher craft' => 'Vlačilci in potiskači',
    'Light-vessels, fire-floats, dredgers, floating cranes, and other vessels the navigability of which is subsidiary to their main function; floating docks; floating or submersible drilling or production platforms' => 'Plovila-svetilniki, gasilska plovila, plavajoči bagri, plavajoče dvigalne naprave in druga plovila, pri katerih je plovba podrejena njihovi glavni funkciji; plavajoči doki; plavajoče ali potapljajoče se vrtalne ali proizvodne ploščadi',
    'Other vessels, including warships and lifeboats other than rowing boats' => 'Druga plovila, vključno z vojnimi ladjami in reševalnimi čolni, razen čolnov na vesla',
    'Other floating structures (for example, rafts, tanks, coffer-dams, landing stages, buoys and beacons)' => 'Druge plavajoče konstrukcije (npr.: splavi, rezervoarji, kesoni, boje in svetilniki)',
    'Optical fibres and optical fibre bundles; optical fibre cables other than those of heading 8544; sheets and plates of polarising material; lenses (including contact lenses), prisms, mirrors and other optical elements, of any material, unmounted, other than such elements of glass not optically worked' => 'Optična vlakna in snopi optičnih vlaken; kabli iz optičnih vlaken, razen tistih iz tarifne številke 8544; listi in plošče iz polarizirajočega materiala; leče (vključno kontaktne leče), prizme, zrcala in drugi optični elementi iz kakršnega koli materiala, nemontirani, razen takih optično neobdelanih steklenih elementov',
    'Lenses, prisms, mirrors and other optical elements, of any material, mounted, being parts of or fittings for instruments or apparatus, other than such elements of glass not optically worked' => 'Leče, prizme, zrcala in drugi optični elementi, iz kakršnega koli materiala, montirani, ki so deli ali pribor instrumentov ali aparatov, razen takih optičnih neobdelanih steklenih elementov',
    'Frames and mountings for spectacles, goggles or the like, and parts thereof' => 'Okviri za očala ali podobni izdelki in njihovi deli',
    'Spectacles, goggles and the like, corrective, protective or other' => 'Očala, naočniki in podobni izdelki, korektivni, zaščitni ali drugi',
    'Binoculars, monoculars, other optical telescopes, and mountings therefor; other astronomical instruments and mountings therefor, but not including instruments for radio-astronomy' => 'Daljnogledi (z enim ali dvema objektivoma), optični teleskopi in njihova stojala; drugi astronomski instrumenti in njihova stojala, razen instrumentov za radio astronomijo',
    'Photographic (other than cinematographic) cameras; photographic flashlight apparatus and flashbulbs other than discharge lamps of heading 8539' => 'Fotografski aparati (razen kinematografskih); fotografski bliskovni aparati in bliskovne sijalke, razen sijalk na razelektrenje iz tarifne številke 8539',
    'Cinematographic cameras and projectors, whether or not incorporating sound recording or reproducing apparatus' => 'Kinematografske kamere in projektorji, vključno s tistimi z vdelanimi aparati za snemanje ali reprodukcijo zvoka',
    'Image projectors, other than cinematographic; photographic (other than cinematographic) enlargers and reducers' => 'Projektorji slik, razen kinematografskih; fotografski aparati (razen kinematografskih) za povečevanje in pomanjševanje',
    'Apparatus and equipment for photographic (including cinematographic) laboratories, not specified or included elsewhere in this chapter; negatoscopes; projection screens' => 'Aparati in oprema za fotografske (tudi kinematografske) laboratorije, ki niso navedeni ali zajeti na drugem mestu v tem poglavju; negatoskopi; zasloni za projekcije',
    'Compound optical microscopes, including those for photomicrography, cinephotomicrography or microprojection' => 'Optični mikroskopi, tudi tisti za mikrofotografijo, mikrokinematografijo in mikroprojekcijo',
    'Microscopes other than optical microscopes; diffraction apparatus' => 'Mikroskopi, razen optičnih mikroskopov; difrakcijski aparati',
    'Lasers, other than laser diodes; other optical appliances and instruments, not specified or included elsewhere in this chapter' => 'Laserji, razen laserskih diod; druge optične naprave in instrumenti, ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Direction finding compasses; other navigational instruments and appliances' => 'Kompasi; drugi navigacijski instrumenti in aparati',
    'Surveying (including photogrammetrical surveying), hydrographic, oceanographic, hydrological, meteorological or geophysical instruments and appliances, excluding compasses; rangefinders' => 'Geodetski (tudi fotogrametrijski), hidrografski, oceanografski, hidrološki, meteorološki ali geofizikalni instrumenti in aparati, razen kompasov; daljinomeri',
    'Balances of a sensitivity of 5 cg or better, with or without weights' => 'Tehtnice z občutljivostjo do vključno 5 centigramov (0,05 g), z utežmi ali brez njih',
    'Drawing, marking-out or mathematical calculating instruments (for example, drafting machines, pantographs, protractors, drawing sets, slide rules, disc calculators); instruments for measuring length, for use in the hand (for example, measuring rods and tapes, micrometers, callipers), not specified or included elsewhere in this chapter' => 'Instrumenti in aparati za risanje, označevanje ali matematično računanje (npr. risalni aparati, pantografi, kotomeri, risalni pribori v kompletu, logaritemska računala, računala v obliki okrogle plošče); ročni instrumenti za merjenje dolžine (npr. merilne palice in trakovi, mikrometrska merila, merila z nonijem), ki niso navedeni ali zajeti na drugem mestu v tem poglavju',
    'Instruments and appliances used in medical, surgical, dental or veterinary sciences, including scintigraphic apparatus, other electromedical apparatus and sight-testing instruments' => 'Medicinski, kirurški, zobozdravniški in veterinarski instrumenti in aparati, vključno s scintigrafskimi, elektromedicinskimi aparati in aparati za preiskavo vida',
    'Mechano-therapy appliances; massage apparatus; psychological aptitude-testing apparatus; ozone therapy, oxygen therapy, aerosol therapy, artificial respiration or other therapeutic respiration apparatus' => 'Aparati za mehanoterapijo; aparati za masažo; aparati za psihološka testiranja; aparati za ozonoterapijo, kisikoterapijo, aerosolno terapijo, umetno dihanje in drugi terapevtski dihalni aparati',
    'Other breathing appliances and gas masks, excluding protective masks having neither mechanical parts nor replaceable filters' => 'Drugi dihalni aparati in plinske maske, razen varovalnih mask brez mehanskih delov in zamenljivih filtrov',
    'Orthopaedic appliances, including crutches, surgical belts and trusses; splints and other fracture appliances; artificial parts of the body; hearing aids and other appliances which are worn or carried, or implanted in the body, to compensate for a defect or disability' => 'Ortopedski pripomočki, vključno bergle, kirurški pasovi in kilni pasovi; opornice in drugi pripomočki za zlome; umetni deli telesa; aparati za izboljšanje sluha in drugi pripomočki, ki se nosijo na telesu ali prenašajo ali vdelajo v telo, za nadomestitev telesne hibe ali invalidnosti',
