    'Instruments, apparatus and models, designed for demonstrational purposes (for example, in education or exhibitions), unsuitable for other uses' => 'Instrumenti, aparati in modeli, namenjeni za demonstriranje (npr. pri pouku ali na razstavah), ki niso primerni za kaj drugega',
    'Machines and appliances for testing the hardness, strength, compressibility, elasticity or other mechanical properties of materials (for example, metals, wood, textiles, paper, plastics)' => 'Stroji in aparati za preskušanje trdote, natezne tlačne trdnosti, elastičnosti ali drugih mehanskih lastnosti materiala (npr. kovin, lesa, tekstilnega materiala, papirja, plastične mase)',
    'Hydrometers and similar floating instruments, thermometers, pyrometers, barometers, hygrometers and psychrometers, recording or not, and any combination of these instruments' => 'Hidrometri in podobni plavajoči instrumenti, termometri, pirometri, barometri, higrometri (vlagomeri) in psihrometri, tudi kombinacije teh instrumentov, z možnostjo registriranja ali brez nje',
    'Instruments and apparatus for measuring or checking the flow, level, pressure or other variables of liquids or gases (for example, flow meters, level gauges, manometers, heat meters), excluding instruments and apparatus of heading 9014, 9015, 9028 or 9032' => 'Instrumenti in aparati za merjenje ali kontrolo pretoka, nivoja, tlaka ali drugih spremenljivih veličin pri tekočinah ali plinih (npr. merilniki pretoka, kazalniki nivoja, manometri, merilniki količine toplote), razen instrumentov in aparatov iz tarifne številke 9014, 9015, 9028 ali 9032',
    'Instruments and apparatus for physical or chemical analysis (for example, polarimeters, refractometers, spectrometers, gas or smoke analysis apparatus); instruments and apparatus for measuring or checking viscosity, porosity, expansion, surface tension or the like; instruments and apparatus for measuring or checking quantities of heat, sound or light (including exposure meters); microtomes' => 'Instrumenti in aparati za fizikalne ali kemične analize (npr. polarimetri, refraktometri, spektrometri, aparati za analizo plina ali dima); instrumenti in aparati za merjenje in kontrolo viskoznosti, poroznosti, raztezanja, površinske napetosti in podobno; instrumenti in aparati za merjenje ali kontroliranje toplote, zvoka ali svetlobe (vključno z ekspozimetri); mikrotomi',
    'Gas, liquid or electricity supply or production meters, including calibrating meters therefor' => 'Merilniki porabe ali proizvodnje plinov, tekočin ali električne energije, vključno z merilniki za njihovo umerjanje',
    'Revolution counters, production counters, taximeters, milometers, pedometers and the like; speed indicators and tachometers, other than those of heading 9014 or 9015; stroboscopes' => 'Števci vrtljajev, števci proizvodnje, taksimetri, kilometrski števci, števci korakov in podobno; kazalniki hitrosti in tahometri, razen tistih, ki se uvrščajo pod tarifno številko 9014 ali 9015; stroboskopi',
    'Oscilloscopes, spectrum analysers and other instruments and apparatus for measuring or checking electrical quantities, excluding meters of heading 9028; instruments and apparatus for measuring or detecting alpha, beta, gamma, X-ray, cosmic or other ionising radiation' => 'Osciloskopi, spektralni analizatorji in drugi instrumenti in aparati za merjenje ali kontrolo električnih veličin, razen merilnikov iz tarifne številke 9028; instrumenti in aparati za merjenje ali odkrivanje alfa, beta, gama, rentgenskih, kozmičnih ali drugih ionizirajočih sevanj',
