    'Automatic regulating or controlling instruments and apparatus' => 'Instrumenti in aparati za avtomatsko regulacijo ali krmiljenje',
    'Parts and accessories (not specified or included elsewhere in this chapter) for machines, appliances, instruments or apparatus of Chapter 90' => 'Deli in pribori (ki niso navedeni ali zajeti na drugem mestu v tem poglavju) za stroje, naprave, instrumente ali aparate iz poglavja 90',
    'Wristwatches, pocket-watches and other watches, including stopwatches, with case of precious metal or of metal clad with precious metal' => 'Ročne, žepne in druge osebne ure, vključno štoparice, z ohišjem, ki je v celoti iz plemenite kovine ali kovine, platirane s plemenito kovino',
